  ('147', '2007-07-26', '2007-07-26 07:30:00', '2007-07-26 07:45:00', 'I talked to Sharon Brennon and gave her my statment regarding what happend in the accident.\r\n\r\nClaim Number: 604910243020\r\n\r\n1) I turned out of my Dr''s office parking lot, and got into the Easbound traffic on Beeach ave.\r\n2) I had to swerve to avoid David as he pulled out from the stop sign on Ryer street.  He was on the south side of Ryar attempting to cross to the north side.\r\n3) In order to avoid oncomming traffic, I had to get back into the eastbound lane. It was at this point that David hit my rear passenger bumber with the front passenger bumper.\r\n4) I parked in the curch parking lot that is the building on the North East corner of Ryar and Beech.\r\n5) I was on crutches and raced around the building where I saw David was parked.\r\n6) David and I exchanged his insurance information and address and phone information, and my drivers licence and address and phone information.  I did not give him my insurance information since it was in the car (around the building).\r\n7) David agreed to let me use his cell phone so I could call my wife.  At that time, I did not believe the car was driveable.\r\n8) During the time we waited for my wife, David said several times that he admitted it was his fault, and that he did not see me comming at all.\r\n9) When My wife arrived, he said to her something to effect of: I hit your husband, but he is not hurt.  She also heard him admit several times that it was his fault.\r\n10)When the police officer arrived, he said that he could not get involved in any aspects of the accident becuase we had exchanged insurance information, and that was in fact, florida law.\r\n11) I specifically asked the officer to cite David at fault for the accident, and he indicated that he was not able to do so.', 'Safeco Insurance called for statement', '2', '2007-07-26 12:18:29.418997', 'DENGLISH', '2007-07-26 12:27:08.418851', 'DENGLISH', 'Y', NULL),
