  ('148', '2007-07-31', '2007-07-31 10:00:00', '2007-07-31 11:30:00', 'You are confirmed to interview with Football Fanatics Tuesday 7/31/07 at 10 am.  A website to view is www.footballfanatics.com and the physical address is 6630 Broadway Avenue Jacksonville, FL 32254.  Once you arrive ask for Larry Warehime (Director of IT) he will conduct the interview.  Attached you will find some helpful interview tips along with a copy of your resume that Larry will have in front of him.  Call me if you have any questions.  Have a great weekend and I will give you a call on Monday to go over any question you may have.  \r\n\r\nSincerely,\r\n\r\nChris Dunham, Recruiter at ATS Services\r\n9700 Philips Highway, Suite 101\r\nJacksonville, Fl 32256\r\n800.346.5574 (Toll Free)\r\n904.224.1338 (Phone)\r\n904.224.1345 (Fax)', 'Meeting with Football Fanatics', '2', '2007-07-26 12:22:55.733485', 'DENGLISH', '2007-07-27 16:21:08.982688', 'DENGLISH', 'Y', NULL),
