  ('174', '2007-09-29', '2007-09-29 10:00:00', '2007-09-29 18:00:00', 'I really did this work on sunday:\r\n\r\nHello Everyone.\r\n \r\nHere is where I am at:\r\n \r\n1) I changed the VCHAR_ARRAY type to be NVCHAR_ARRAY.  (see create_nvchar_array.sql).  \r\nI had great difficulty getting the VCHAR_ARRAY type to work.  I did some goggling\r\naround, and found out that if I defined an associated array of type NVARCHAR(255),\r\neverything would work.\r\n \r\n If you want to mess around with the type, the relevant procedures are in\r\n \r\n acgestore.zip:acgestore\\wds\\src\\com\\wds\\utils\\wds_oracle_sp.java\r\n functions: setArray and getOutArray\r\n \r\n2) I create 2 servlets.  One for the posRequest, and one for the orderRequest.  These are in\r\n \r\n acgestore.zip:acgestore\\acgestore\\WebRoot\\posRequest.java\r\n acgestore.zip:acgestore\\acgestore\\WebRoot\\orderRequest.java\r\n \r\nWhen I test the servlets, I can see that there is a problem in the stored procedures with various things.  For instance, the to_date function is crashing in the order_request procedure.  You will need to parse the cXML example of the date time format.  (See test program):\r\n \r\nThese two can be tested (verified since I tested them) from:\r\n \r\n acgestore.zip:acgestore\\xml_over_http_client\\src\\com\\comspec\\budco\\cxmloverhttp\\TestJava.java.\r\n \r\nPlease note the setup necessary for servlets in \r\n \r\n acgestore.zip:acgestore\\acgestore\\WebRoot\\WEB-INF\\web.xml\r\n \r\nFor some reason, we have to make a copy of all of the init-param entries\r\nthat we can globally use for JSP''s.  (A limitation of servlets? - Seems\r\nlike we should be able to set up some sort of common initilization parameters\r\nto get all of that working.\r\n \r\nSTORE PROC:\r\n \r\nI create a new package called bes_webservices_pkg_tst.  I did this so I won''t step\r\non anyones toes when I am developing.  I currently copied the contents of bes_webservices_pkg\r\nas of 9/30/2007 at around 1:00pm to make sure that everything can compile.  Please note\r\nthe following (necessary) changes.\r\n \r\n\r\nSTORED PROC CHANGES:\r\n \r\n1) Changes all VCHAR_ARRAY types to AAA_DEV.NVCHAR_ARRAY types.  Otherwise\r\nI could not get the Java layer to "talk" to the stored procedures in terms\r\nor arrays.\r\n \r\n2) I added the following parameters to order_request procedure:\r\n \r\n    , p_RespVersion                  out varchar2             -- 116\r\n    , p_RespPayloadID                out varchar2             -- 117\r\n    , p_RespTimestamp                out varchar2             -- 118\r\n    , p_RespXmllang                  out varchar2             -- 119\r\n    , p_RespStatus                   out varchar2             -- 120\r\n    , p_RespStatusCode               out varchar2             -- 121\r\n    , p_RespStatusText               out varchar2             -- 122\r\n \r\nThis is becuase we are supposed to return values which we will use to\r\ncontruct the cXML response.\r\n \r\n\r\nWhat I did not do:\r\n \r\nI was not able to "move" the code into the "GenericEStore" code.  Everything\r\nis currently testable via MyEclipse 6.0 (full technology stack).  If your not\r\nusing that, then you may have some difficulty setting up a tomcat server, build\r\nfiles, etc.  In fact, I wouldn''t know how to advise you to get the accomplished.', 'COMSPEC WORK', '2', '2007-09-30 18:45:33.756736', 'DENGLISH', '2007-09-30 18:45:33.756736', 'DENGLISH', 'Y', NULL),
  ('175', '2007-10-01', '2007-10-01 20:00:00', '2007-10-01 23:30:00', 'Got code to compile in Maven.\r\n\r\nI originally retreived the file.\r\n \r\nfile://loki/server_z/ComspecProjects/BUDCO/AAA/Java/GenericEStore.zip\r\n \r\nIt is not longer there.  I assume it has been moved to one of the dated subfolders.  Not sure which one.\r\nNow, I have integrated our code and test into that project.  You can find the (newly integrated) source code at:\r\n \r\nfile://loki/server_z/ComspecProjects/BUDCO/AAA/Java/GenericEStore_CXml_0.5.zip\r\n \r\nThe following code files were added to integrate our code:\r\n \r\n1) src\\test\\java\\com\\comspec\\budco\\cxmloverhttp\\\\*.java\r\n2) src\\test\\java\\com\\comspec\\empower\\\\*.java <- this was by mistake.  I don''t think this is needed.  This was imodules stuff...\r\n3) src\\main\\java\\com\\wds\\\\*.java\r\n4) src\\main\\java\\com\\comspec\\\\*.java <- Servlets here under budco\\agcestore\\servlet\r\n5) Changed pom.xml file in root added:\r\n \r\n  <dependency>\r\n   <groupId>com.oracle</groupId>\r\n   <artifactId>ojdbc14</artifactId>\r\n   <version>9.0.2.0.0</version>\r\n  </dependency>\r\n\r\n-------------------------------------------- TO DO --------------------------------------------------------\r\nVicki, I spent my time getting our code to compile the source using:\r\n \r\nmvn package\r\n \r\nHowever, the servlets are not configured yet in the GenericEStore projects web.xml.\r\nYou will have to do this.  I will attach the web.xml file that I used in my mini-project.\r\nThis will show you how they are to be configured.\r\n \r\n** Please Note that I added the servlets to a package in the source integration\r\nwhere in the example web.xml file there is no package in the namespace portion.\r\nYou will have to add this.\r\n \r\nYou and Steve will have to figure out how to deploy this application so they\r\ncan see it.  You must make the servlets available via web.xml on a JBoss server\r\nyou will deploy the app to.  After that to make them visible you can by either:\r\n \r\n1) Put the current JBoss machine in the DMZ (It''s a crappy machine though)\r\n2) Create a new JBoss server, and put IT in the DMZ.\r\n \r\nNow, Integrate your changes into the changes you isolate by comparing the two\r\nzip file mentioned above and check it into CVS.  That way we will have the "latest\r\nand greatest" code.\r\n-------------------------------------------- END TO DO --------------------------------------------------------\r\n \r\nHere is what I had to add to the Maven repository to get it to comple  (I added them for your convenience):\r\n \r\nAdding To Maven Repository\r\nThe following files were added to the maven repository:\r\n\r\nOracle Classes\r\ncom\\oracle\\ojdbc14\\9.0.2.0.0\\ojdbc14-9.0.2.0.0.jar \r\ncom\\oracle\\ojdbc14\\9.0.2.0.0\\ojdbc14-9.0.2.0.0.pom \r\nThe file ojdbc14-9.0.2.0.0.jar was named as such after downloading the file ojdbc14.jar from the oracle website. \r\nThe file ojdbc14-9.0.2.0.0.pom was downloaded from http://repo1.maven.org/maven2/com/oracle/ojdbc14/9.0.2.0.0/ . \r\n', 'COMSPEC WORK', '2', '2007-10-02 00:01:25.686973', 'DENGLISH', '2007-10-02 19:04:38.386278', 'DENGLISH', 'Y', NULL),
