  ('181', '2007-11-14', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Xml.Schema;\r\nusing System.Xml;\r\n\r\nnamespace XSDTesting\r\n{\r\n    class Program\r\n    {\r\n        public static void ValidateXml(string xmlFilename, string schemaFilename)\r\n        {\r\n            XmlTextReader r = new XmlTextReader(xmlFilename);\r\n            XmlValidatingReader validator = new XmlValidatingReader(r);\r\n            validator.ValidationType = ValidationType.Schema;\r\n\r\n            XmlSchemaCollection schemas = new XmlSchemaCollection();\r\n            schemas.Add(null, schemaFilename);\r\n            validator.Schemas.Add(schemas);\r\n\r\n            validator.ValidationEventHandler += new ValidationEventHandler(ValidationEventHandler);\r\n\r\n            try\r\n            {\r\n                while (validator.Read()) ;\r\n            }\r\n            catch (XmlException err)\r\n            {\r\n                Console.WriteLine( err.Message);\r\n            }\r\n            finally\r\n            {\r\n                validator.Close();\r\n            }\r\n        }\r\n\r\n        private static void ValidationEventHandler(object sender, ValidationEventArgs args)\r\n        {\r\n            Console.WriteLine("Validation error (" + args.Exception.LineNumber + ", " + args.Exception.LinePosition + "): " + args.Message);\r\n        }\r\n        \r\n        private static void Main()\r\n        {\r\n            Console.WriteLine("Validating your.xml.");\r\n            ValidateXml(@"c:\\temp\\xsd.xml", @"c:\\temp\\xsd.xsd");\r\n        }\r\n    }\r\n}\r\n', 'XSD Example', '2', '2007-11-14 17:42:19.243847', 'DENGLISH', '2007-11-14 17:42:19.243847', 'DENGLISH', 'Y', NULL),
  ('182', '2007-11-14', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Collections;\r\n\r\n//=============================================================================\r\n// Author                    Version     Date\r\n// David Alexander English   1.0         10/19/2007\r\n//=============================================================================\r\n// ** Please list all changes, and indicate the author of them.\r\n//=============================================================================\r\n\r\nnamespace Payformance.Utils\r\n{\r\n    public class Dequeue<T> : IEnumerable<T>\r\n    {\r\n        #region Private Implementation Details\r\n        private class Link<T>\r\n        {\r\n            public T m_T;\r\n\r\n            public Link<T> m_Next = null;\r\n            public Link<T> m_Prev = null;\r\n\r\n            public Link(T a_T)\r\n            { m_T = a_T; }\r\n\r\n            public T Value\r\n            { get { return m_T; } }\r\n        }\r\n\r\n        private Link<T> m_First = null;\r\n        private Link<T> m_Last = null;\r\n        private int m_iCount = 0;\r\n        #endregion\r\n\r\n        #region Constructors\r\n        public Dequeue()\r\n        { }\r\n\r\n        public Dequeue(IEnumerable<T> a_Enumerable)\r\n        {\r\n            IEnumerator<T> l_Enumerator = a_Enumerable.GetEnumerator();\r\n            while (l_Enumerator.MoveNext())\r\n                PushBack(l_Enumerator.Current);\r\n        }\r\n        #endregion\r\n\r\n        #region Properties\r\n        public bool HasItems\r\n        { get { return m_iCount != 0; } }\r\n\r\n        public bool IsEmpty\r\n        { get { return m_iCount == 0; } }\r\n\r\n        public int Count\r\n        { get { return m_iCount; } }\r\n        #endregion\r\n\r\n        #region Front Queue Operations\r\n        public void PushFront(T a_T)\r\n        {\r\n            Link<T> l_NewLink = new Link<T>(a_T);\r\n            if (IsEmpty)\r\n            {\r\n                m_First = l_NewLink;\r\n                m_Last = l_NewLink;\r\n            }\r\n            else\r\n            {\r\n                m_First.m_Prev = l_NewLink;\r\n                l_NewLink.m_Next = m_First;\r\n                m_First = l_NewLink;\r\n            }\r\n            ++m_iCount;\r\n        }\r\n\r\n        public T PeekFront()\r\n        { return m_First.Value; }\r\n\r\n        public T PopFront()\r\n        {\r\n            Link<T> l_Link = m_First;\r\n            if (m_iCount == 1)\r\n            {\r\n                m_First = null;\r\n                m_Last = null;\r\n            }\r\n            else\r\n            {\r\n                m_First = m_First.m_Next;\r\n                m_First.m_Prev = null;\r\n            }\r\n            --m_iCount;\r\n            return l_Link.Value;\r\n        }\r\n        #endregion\r\n\r\n        #region Back Queue Operations\r\n        public void PushBack(T a_T)\r\n        {\r\n            Link<T> l_NewLink = new Link<T>(a_T);\r\n\r\n            if (IsEmpty)\r\n            {\r\n                m_First = l_NewLink;\r\n                m_Last = l_NewLink;\r\n            }\r\n            else\r\n            {\r\n                m_Last.m_Next = l_NewLink;\r\n                l_NewLink.m_Prev = m_Last;\r\n                m_Last = l_NewLink;\r\n            }\r\n            ++m_iCount;\r\n        }\r\n\r\n        public T PeekBack()\r\n        { return m_Last.Value; }\r\n\r\n        public T PopBack()\r\n        {\r\n            Link<T> l_Link = m_Last;\r\n            if (m_iCount == 1)\r\n            {\r\n                m_First = null;\r\n                m_Last = null;\r\n            }\r\n            else\r\n            {\r\n                m_Last = m_Last.m_Prev;\r\n                m_Last.m_Next = null;\r\n            }\r\n            --m_iCount;\r\n            return l_Link.Value;\r\n        }\r\n        #endregion\r\n\r\n        #region Enumerable Implementation\r\n        public IEnumerator<T> GetEnumerator()\r\n        {\r\n            return this.Forward.GetEnumerator();\r\n        }\r\n\r\n        public IEnumerable<T> Forward\r\n        {\r\n            get\r\n            {\r\n                Link<T> l_Link = m_First;\r\n                while (l_Link != null)\r\n                {\r\n                    yield return l_Link.Value;\r\n                    l_Link = l_Link.m_Next;\r\n                }\r\n            }\r\n        }\r\n\r\n        public IEnumerable<T> Reverse\r\n        {\r\n            get\r\n            {\r\n                Link<T> l_Link = m_Last;\r\n                while (l_Link != null)\r\n                {\r\n                    yield return l_Link.Value;\r\n                    l_Link = l_Link.m_Prev;\r\n                }\r\n            }\r\n        }\r\n\r\n        IEnumerator IEnumerable.GetEnumerator()\r\n        {\r\n            throw new Exception("Dequeue<T> only support type safe operations. Get a life, and code correctly!");\r\n        }\r\n        #endregion\r\n    }\r\n}\r\n', 'Dequeue Example', '2', '2007-11-14 17:42:56.84433', 'DENGLISH', '2007-11-14 17:42:56.84433', 'DENGLISH', 'Y', NULL),
  ('183', '2007-11-14', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Xml;\r\nusing System.IO;\r\n\r\nnamespace Payformance.Utils\r\n{\r\n    public class DomXPath\r\n    {\r\n        public static string getXPath(XmlNode a_node)\r\n        {\r\n            return getXPath(a_node, true, false);\r\n        }\r\n\r\n        public static string getXPath(XmlNode a_node, bool a_bIncludeZeroIndex)\r\n        {\r\n            return getXPath(a_node, true, a_bIncludeZeroIndex);\r\n        }\r\n\r\n        public static string getXPath(XmlNode a_node, bool a_bIncludeIndex, bool a_bIncludeZeroIndex)\r\n        {\r\n            List<XmlElement> l_list = new List<XmlElement>();\r\n            XmlNode l_node = a_node;\r\n            while (l_node.LocalName != "#document")\r\n            {\r\n                if (l_node is XmlElement)\r\n                    l_list.Add((XmlElement)l_node);\r\n                l_node = l_node.ParentNode;\r\n            }\r\n            XmlElement[] l_ary = l_list.ToArray();\r\n\r\n            StringWriter l_oss = new StringWriter();\r\n            for (int l_idx = l_ary.Length - 1; l_idx >= 0; --l_idx)\r\n            {\r\n                l_oss.Write("/" + l_ary[l_idx].Name);\r\n                if (a_bIncludeIndex)\r\n                    l_oss.Write(IndexString(l_ary[l_idx], a_bIncludeZeroIndex));\r\n            }\r\n\r\n            return l_oss.ToString();\r\n        }\r\n\r\n\r\n        public static List<XPathIdx> getXPathIdx(XmlNode a_elem)\r\n        {\r\n            Dequeue<XmlElement> l_deq = new Dequeue<XmlElement>();\r\n            XmlNode l_node = a_elem;\r\n            while (l_node.LocalName != "#document")\r\n            {\r\n                if (l_node is XmlElement)\r\n                    l_deq.PushFront((XmlElement)l_node);\r\n                l_node = l_node.ParentNode;\r\n            }\r\n\r\n            List<XPathIdx> l_list = new List<XPathIdx>();\r\n            foreach (XmlElement l_elem in l_deq)\r\n                l_list.Add(new XPathIdx(l_elem.Name, Index((XmlElement)a_elem)));\r\n\r\n            return l_list;\r\n        }\r\n\r\n        private static readonly string m_AlternativeIndexAttribute = "Name";\r\n        private static string IndexString(XmlElement a_elem, bool a_bIncludeSingleIndex)\r\n        {\r\n            if (a_elem.ParentNode.LocalName == "#document")\r\n                return "";\r\n\r\n            if (a_elem.GetAttributeNode(m_AlternativeIndexAttribute) != null)\r\n                return "[ @" + m_AlternativeIndexAttribute + " = ''" + a_elem.Attributes[m_AlternativeIndexAttribute].Value + "'']";\r\n\r\n            return "[" + (Index(a_elem) + 1) + "]"; ;\r\n        }\r\n\r\n        private static int Index(XmlElement a_elem)\r\n        {\r\n            int l_iCountBefore = 0;\r\n            int l_iCountAfter = 0;\r\n            bool l_bFoundItem = false;\r\n            foreach (XmlNode l_node in a_elem.ParentNode.ChildNodes)\r\n                if (l_node is XmlElement)\r\n                {\r\n                    XmlElement l_element = (XmlElement)l_node;\r\n                    if (l_element.Equals(a_elem))\r\n                        l_bFoundItem = true;\r\n                    else if ((l_bFoundItem)\r\n                              && (l_element.Name.Equals(a_elem.Name)))\r\n                        l_iCountAfter++;\r\n                    else if (l_element.Name.Equals(a_elem.Name))\r\n                        l_iCountBefore++;\r\n                }\r\n\r\n            int l_Idx = 1;\r\n            if (l_iCountBefore > 0)\r\n                l_Idx = (++l_iCountBefore);\r\n\r\n            return l_Idx - 1;\r\n        }\r\n    }\r\n}\r\n', 'DOM XPath', '2', '2007-11-14 17:43:28.526489', 'DENGLISH', '2007-11-14 17:43:28.526489', 'DENGLISH', 'Y', NULL),
  ('184', '2007-11-14', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Xml;\r\nusing System.IO;\r\n\r\nnamespace Payformance.Utils\r\n{\r\n    public class SaxParser\r\n    {\r\n        //=====================================================================\r\n        // PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVA\r\n        // PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVA\r\n        // PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVA\r\n        //=====================================================================\r\n        //private string m_inputFilename;\r\n        private Dequeue<string> m_path = new Dequeue<string>();\r\n        private XmlTextReader m_xmlReader;\r\n        private bool m_bInnerXmlRead = false;\r\n        private bool m_bContinueReading = true;\r\n\t\tprivate long m_lLine = 0;\r\n\t\tprivate long m_lColumn = 0;\r\n        private bool m_bNeedsClosing = false;\r\n\r\n        public void SetWhitespaceHandling(WhitespaceHandling a_WhitespaceHandling)\r\n        { m_xmlReader.WhitespaceHandling = a_WhitespaceHandling; }\r\n\r\n\t\tpublic long Line\r\n\t\t{ get { return m_lLine; } }\r\n\r\n\t\tpublic long Column\r\n\t\t{ get { return m_lColumn; } }\r\n        \r\n        private SortedDictionary<string, string> loadAttributes(XmlTextReader a_reader)\r\n        {\r\n            SortedDictionary<string, string> l_attributes = new SortedDictionary<string, string>();\r\n            for (int l_idx = 0; l_idx < a_reader.AttributeCount; ++l_idx)\r\n            {\r\n                a_reader.MoveToAttribute(l_idx);\r\n                l_attributes.Add(a_reader.Name, a_reader.Value);\r\n            }\r\n            return l_attributes;\r\n        }\r\n\r\n        //=====================================================================\r\n        // PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PR\r\n        // PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PR\r\n        // PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PR\r\n        //=====================================================================\r\n        protected string XPath\r\n        {\r\n            get\r\n            {\r\n                StringBuilder l_sb = new StringBuilder();\r\n                foreach (string l_str in m_path)\r\n                    l_sb.Append(@"/" + l_str);\r\n                return l_sb.ToString();\r\n            }\r\n        }\r\n\r\n        protected int Depth\r\n        { get { return m_path.Count; } }\r\n\r\n        //=====================================================================\r\n        // PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBL\r\n        // PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBL\r\n        // PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBL\r\n        //=====================================================================\r\n        //public string InputFilename\r\n        //{ get { return m_inputFilename; } }\r\n\r\n        public virtual void StartDocument()\r\n        {\r\n        }\r\n\r\n        public virtual void EndDocument()\r\n        {\r\n        }\r\n\r\n        public virtual void Declaration(SortedDictionary<string, string> a_attributes)\r\n        {\r\n        }\r\n\r\n        public virtual void StartElement( string a_namespaceURI\r\n                                , string a_sName\r\n                                , string a_qName\r\n                                , SortedDictionary<string, string> a_attributes)\r\n        {\r\n        }\r\n        \r\n        public virtual void EndElement( string a_namespaceURI\r\n                              , string a_sName\r\n                              , string a_qName)\r\n        {\r\n        }\r\n\r\n        public virtual void Characters(string a_buffer)\r\n        {\r\n        }\r\n\r\n        public virtual void Whitespace(string a_ws)\r\n        {\r\n        }\r\n\r\n        public SaxParser(string a_inputFile)\r\n        {\r\n            m_xmlReader = new XmlTextReader(a_inputFile);\r\n            m_bNeedsClosing = true;\r\n            //m_inputFilename = a_inputFile;\r\n        }\r\n\r\n        public SaxParser(Stream a_InputStream)\r\n        {\r\n            m_xmlReader = new XmlTextReader(a_InputStream);\r\n            //m_inputFilename = a_inputFile;\r\n        }\r\n\r\n        protected string ReadInnerXml()\r\n        {\r\n            if (m_bInnerXmlRead != false)\r\n                throw new Exception("SaxParser exception: Cannot ReadInnerXml twice on the same node");\r\n            string l_xml = m_xmlReader.ReadInnerXml();\r\n            //SLog.WriteLine("READ INNER XML: " + l_xml);\r\n            m_bInnerXmlRead = true;\r\n            return l_xml;\r\n        }\r\n        \r\n        protected void StopReading()\r\n        { m_bContinueReading = false; }\r\n\r\n        public bool ParsedWholeFile\r\n        { get { return m_bContinueReading; } }\r\n        \r\n        public virtual void Parse()\r\n        {\r\n            while (m_bContinueReading)\r\n            {\r\n                if( m_bInnerXmlRead)\r\n                    m_bInnerXmlRead = false;\r\n                else if( !m_xmlReader.Read())\r\n                    break;\r\n\r\n\t\t\t\tm_lLine = m_xmlReader.LineNumber;\r\n\t\t\t\tm_lColumn = m_xmlReader.LinePosition;\r\n                \r\n                switch (m_xmlReader.NodeType)\r\n                {\r\n                    case XmlNodeType.Element:\r\n                        if (m_path.Count == 0)\r\n                            StartDocument();\r\n                        m_path.PushBack( m_xmlReader.Name);\r\n                        bool l_bIsEmptyElement = m_xmlReader.IsEmptyElement;\r\n                        StartElement(m_xmlReader.NamespaceURI, m_xmlReader.Name, m_xmlReader.Name, loadAttributes(m_xmlReader));\r\n                        if (l_bIsEmptyElement)\r\n                            m_path.PopBack();\r\n                        else if (m_bInnerXmlRead)\r\n                            m_path.PopBack();\r\n                        break;\r\n                    case XmlNodeType.EndElement:\r\n                        EndElement(m_xmlReader.NamespaceURI, m_xmlReader.Name, m_xmlReader.Name);\r\n                        m_path.PopBack();\r\n                        if (m_path.Count == 0)\r\n                            EndDocument();\r\n                        break;\r\n                    case XmlNodeType.Text:\r\n                        Characters(m_xmlReader.Value);\r\n                    break;\r\n                    case XmlNodeType.Whitespace:\r\n                        Whitespace(m_xmlReader.Value);\r\n                    break;\r\n                    case XmlNodeType.XmlDeclaration:\r\n                        Declaration(loadAttributes(m_xmlReader));\r\n                    break;\r\n                    default:\r\n                        if( m_xmlReader.NodeType == XmlNodeType.Document)\r\n                            throw new Exception("This has never been seen in parsing.  I think the document node is of type XmlElement");\r\n                    break;\r\n                }\r\n            }\r\n            if (m_bNeedsClosing) m_xmlReader.Close();\r\n        }\r\n    }\r\n}\r\n', 'Sax Parser', '2', '2007-11-14 17:44:02.50218', 'DENGLISH', '2007-11-14 17:44:02.50218', 'DENGLISH', 'Y', NULL),
  ('185', '2007-11-13', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\n\r\nnamespace Payformance.Utils\r\n{\r\n    public class XPathIdx\r\n    {\r\n        public XPathIdx(string s, int i)\r\n        {\r\n            m_dirName = s;\r\n            m_index = i;\r\n        }\r\n\r\n        public string DirName\r\n        { get { return m_dirName; } }\r\n\r\n        public int Index\r\n        {\r\n            get { return m_index; }\r\n            set { m_index = value; }\r\n        }\r\n\r\n        private string m_dirName;\r\n\r\n        private int m_index;\r\n\r\n        public override string ToString()\r\n        {\r\n            return m_dirName + "[" + m_index + "]";\r\n        }\r\n    }\r\n}\r\n', 'XPath IDX', '2', '2007-11-14 17:44:24.276092', 'DENGLISH', '2007-11-14 17:44:24.276092', 'DENGLISH', 'Y', NULL),
  ('195', '2007-11-15', NULL, NULL, '        static void WebCrawl(Uri a_Uri)\r\n        {\r\n            using (HttpReader_Stream l_WebStream = new HttpReader_Stream(a_Uri))\r\n            {\r\n                List<Uri> l_list = new List<Uri>();\r\n                Regex l_URL_Regex = new Regex( "href\\\\s*=\\\\s*(?:\\"(?''1''[^\\"]*)\\"|(?''1''\\\\S+)).*>"\r\n                                             , RegexOptions.IgnoreCase|RegexOptions.Compiled);\r\n\r\n                string l_page = l_WebStream.Reader.ReadToEnd();\r\n\r\n                Match l_Match = l_URL_Regex.Match(l_page);\r\n\r\n                for (; l_Match.Success; l_Match = l_Match.NextMatch())\r\n                {\r\n                    string l_uriFound = l_Match.Groups[1].ToString();\r\n                    Uri l_FoundUri = new Uri(a_Uri, l_uriFound);\r\n                    l_list.Add(l_FoundUri); // l_Match.Groups[1].ToString());\r\n                }\r\n            }\r\n        }\r\n', 'Web Crawler', '2', '2007-11-26 17:48:49.008657', 'DENGLISH', '2007-11-26 17:48:49.008657', 'DENGLISH', 'Y', NULL),
