  ('186', '2007-11-13', NULL, NULL, 'using System;\r\nusing System.Collections;\r\nusing System.Data;\r\nusing System.Diagnostics;\r\nusing System.IO;\r\nusing System.Text;\r\nusing System.Threading;\r\nusing System.Xml;\r\n\r\nnamespace Payformance.Utils\r\n{\r\n\t/// <summary>\r\n\t/// Summary description for SimpleLog.\r\n\t/// </summary>\r\n\tpublic class SLog\r\n\t{\r\n#if DEBUG\r\n\t\tprivate static string m_debugFile = @"c:\\temp\\simple_static_log.txt";\r\n#endif\r\n\r\n\t\tpublic static void Reset()\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tMonitor.Enter(typeof(SLog));\r\n\t\t\ttry\r\n\t\t\t{\r\n\t\t\t\tif( File.Exists( m_debugFile))\r\n\t\t\t\t\tFile.Delete( m_debugFile);\r\n\t\t\t}\r\n\t\t\tfinally\r\n\t\t\t{\r\n\t\t\t\tMonitor.Exit(typeof(SLog));\r\n\t\t\t}\r\n#endif\r\n\t\t}\r\n\r\n\t\tpublic static string Write( Hashtable a_hashtable, string a_name)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tStringBuilder l_sa = new StringBuilder ();\r\n\t\t\tWriteString( l_sa.ToString());\r\n\t\t\treturn l_sa.ToString();\r\n#endif\r\n\t\t\treturn "";\r\n\t\t}\r\n\r\n\t\tpublic static void Write( StringBuilder l_sa, Hashtable a_hashtable, string a_name)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tif( a_hashtable == null)\r\n\t\t\t{\r\n\t\t\t\tl_sa.Append( "Hashtable " + a_name + " is null" + Environment.NewLine);\r\n\t\t\t\treturn;\r\n\t\t\t}\r\n\r\n\t\t\tl_sa.Append( "Hastable " + a_name + " of size " + a_hashtable.Count + Environment.NewLine);\r\n\t\t\tforeach ( DictionaryEntry l_pair in a_hashtable)\r\n\t\t\t\tif( l_pair.Value is XmlAttribute)\r\n\t\t\t\t\tl_sa.Append( a_name + "[ \\"" + l_pair.Key + "\\"] = " + ((XmlAttribute)(l_pair.Value)).Value + Environment.NewLine);\r\n\t\t\t\telse if( l_pair.Value is XmlElement)\r\n\t\t\t\t\tl_sa.Append( a_name + "[ \\"" + l_pair.Key + "\\"] = " + ((XmlElement)(l_pair.Value)).InnerXml + Environment.NewLine);\r\n\t\t\t\telse\r\n\t\t\t\t\tl_sa.Append( a_name + "[ \\"" + l_pair.Key + "\\"] = " + l_pair.Value + Environment.NewLine);\r\n#endif\r\n\t\t}\r\n\r\n\t\tpublic static void Write( DataSet a_dataSet, string a_header)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tStringBuilder l_sb = new StringBuilder ();\r\n\t\t\tWrite( l_sb, a_dataSet, a_header);\r\n\t\t\tWriteString( l_sb.ToString());\r\n#endif\r\n\t\t}\r\n\r\n\t\tprivate static void Write( StringBuilder l_sb, DataSet a_dataSet, string a_header)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tforeach( DataTable l_table in a_dataSet.Tables)\r\n\t\t\t{\r\n\t\t\t\tWrite( l_sb, l_table, a_header);\r\n\t\t\t}\r\n#endif\r\n\t\t}\r\n\r\n\t\tpublic static void Write( DataTable a_table, string a_header)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tStringBuilder l_sb = new StringBuilder ();\r\n\t\t\tWrite( l_sb, a_table, a_header);\r\n\t\t\tWriteString( l_sb.ToString());\r\n#endif\r\n\t\t}\r\n\r\n\t\tpublic static void Write( StringBuilder l_sb, DataTable a_table, string a_header)\r\n\t\t{\r\n\t\t\t//=================================================================\r\n\t\t\t// Get the columns into two SortedDictionary objects\r\n\t\t\t//=================================================================\r\n\t\t\tl_sb.Append( "--------- " + a_table.TableName + "[ " + a_table.Rows.Count + "][ " + a_table.Columns.Count + "]: " + a_header + " --------------------" + Environment.NewLine);\r\n\t\t\tint[] l_iColumnSizes = new int [a_table.Columns.Count];\r\n\t\t\tfor( int l_idx = 0; l_idx < a_table.Columns.Count; ++l_idx)\r\n\t\t\t\tl_iColumnSizes[ l_idx] = a_table.Columns[ l_idx].ColumnName.Length;\r\n\r\n\t\t\tforeach (DataRow l_row in a_table.Rows)\r\n\t\t\t\tfor (int l_colIdx = 0; l_colIdx < l_row.ItemArray.Length; l_colIdx++)\r\n\t\t\t\t\tif( l_row[ l_colIdx ].ToString().Length > l_iColumnSizes[ l_colIdx])\r\n\t\t\t\t\t\tl_iColumnSizes[ l_colIdx] = l_row[ l_colIdx ].ToString().Length;\r\n\r\n\t\t\tint l_iColIdx = -1;\r\n\t\t\tforeach (DataColumn l_col in a_table.Columns)\r\n\t\t\t{\r\n\t\t\t\tl_sb.Append( pad( l_col.ColumnName, l_iColumnSizes[ ++l_iColIdx]));\r\n\t\t\t\tl_sb.Append( " ");\r\n\t\t\t}\r\n\t\t\tl_sb.Append( Environment.NewLine);\r\n\r\n\t\t\tforeach (DataRow l_row in a_table.Rows)\r\n\t\t\t{\r\n\t\t\t\tl_iColIdx = -1;\r\n\t\t\t\tfor (int l_colIdx = 0; l_colIdx < l_row.ItemArray.Length; l_colIdx++)\r\n\t\t\t\t{\r\n\t\t\t\t\tl_sb.Append( pad( l_row[ l_colIdx ].ToString(), l_iColumnSizes[ ++l_iColIdx]));\r\n\t\t\t\t\tl_sb.Append( " ");\r\n\t\t\t\t}\r\n\t\t\t\tl_sb.Append( Environment.NewLine);\r\n\t\t\t}\r\n\t\t\tl_sb.Append( Environment.NewLine);\r\n\t\t}\r\n\r\n\t\tpublic static void Write( XmlDocument a_xmlDocument, string a_name)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tif( a_xmlDocument == null)\r\n\t\t\t{\r\n\t\t\t\tWriteString( "XmlDocument " + a_name + " is null");\r\n\t\t\t\treturn;\r\n\t\t\t}\r\n\r\n\t\t\tStringWriter l_sw = null;\r\n\t\t\ttry\r\n\t\t\t{\r\n\t\t\t\tl_sw = new StringWriter ();\r\n\t\t\t\ta_xmlDocument.Save( l_sw); // @"c:\\temp\\dump.xml");\r\n\t\t\t\tWriteLine( l_sw.ToString());\r\n\t\t\t}\r\n\t\t\tcatch( Exception e)\r\n\t\t\t{\r\n\t\t\t\tstring l_msg = e.Message;\r\n\t\t\t}\r\n\t\t\tfinally\r\n\t\t\t{\r\n\t\t\t\tif( l_sw != null)\r\n\t\t\t\t{\r\n\t\t\t\t\tl_sw.Flush();\r\n\t\t\t\t\tl_sw.Close();\r\n\t\t\t\t}\r\n\t\t\t}\r\n#endif\r\n\t\t}\r\n\r\n\t\tpublic static void WriteString( string s)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tFileStream l_fs = null;\r\n\t\t\tTextWriter l_tw = null;\r\n\t\t\ttry\r\n\t\t\t{\r\n\t\t\t\tMonitor.Enter(typeof(SLog));\r\n\t\t\t\t//File.AppendText( m_debugFile).Write( s);\r\n\t\t\t\tl_fs = new FileStream( m_debugFile, FileMode.Append);\r\n\t\t\t\tl_tw = new StreamWriter( l_fs);\r\n\t\t\t\tl_tw.Write( s);\r\n\t\t\t}\r\n\t\t\tcatch( Exception e)\r\n\t\t\t{\r\n\t\t\t\tstring l_msg = e.Message;\r\n\t\t\t}\r\n\t\t\tfinally\r\n\t\t\t{\r\n\t\t\t\tif( l_tw != null)\r\n\t\t\t\t{\r\n\t\t\t\t\tl_tw.Flush();\r\n\t\t\t\t\tl_tw.Close();\r\n\t\t\t\t}\r\n\t\t\t\tif( l_fs != null)\r\n\t\t\t\t\tl_fs.Close();\r\n\t\t\t\tMonitor.Exit(typeof(SLog));\r\n\t\t\t}\r\n#endif\r\n\t\t}\r\n\r\n        public static void WriteLine(string s)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tWriteString( s + Environment.NewLine);\r\n#endif\r\n\t\t}\r\n\r\n\t\tpublic static void Write( string s)\r\n\t\t{\r\n#if DEBUG\r\n\t\t\tWriteString( s);\r\n#endif\r\n\t\t}\r\n\r\n\t\tprivate static string m_pad = "                                                  ";\r\n\t\tprivate static string pad( string a_str, int a_Size)\r\n\t\t{\r\n\t\t\tif( a_str.Length >= a_Size)\r\n\t\t\t\treturn a_str;\r\n\t\t\tif( a_str.Length + m_pad.Length < a_Size)\r\n\t\t\t\treturn pad( a_str + m_pad, a_Size);\r\n\t\t\treturn a_str + m_pad.Substring( 0, a_Size - a_str.Length);\r\n\t\t}\r\n\t}\r\n}\r\n', 'Simple Static Log', '2', '2007-11-14 17:45:02.093574', 'DENGLISH', '2007-11-14 17:45:02.093574', 'DENGLISH', 'Y', NULL),
  ('187', '2007-11-13', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing Payformance.Utils;\r\n\r\nnamespace EDIFragmentGui.FormMessages\r\n{\r\n    public class MessagePump<T>\r\n    {\r\n        private Queue<T> m_pump = new Queue<T>();\r\n\r\n        public MessagePump()\r\n        { }\r\n\r\n        public bool HasMessages\r\n        {\r\n            get\r\n            {\r\n                bool l_bReturnVal;\r\n                lock (this)\r\n                    l_bReturnVal = m_pump.Count > 0;\r\n                return l_bReturnVal;\r\n            }\r\n        }\r\n\r\n        public void SendMessage(T a_message)\r\n        {\r\n            lock (this)\r\n            {\r\n                m_pump.Enqueue(a_message);\r\n            }\r\n        }\r\n\r\n        //public void SendMessage( string a_MethodName, Exception a_Exception)\r\n        //{\r\n        //    lock (this)\r\n        //    {\r\n        //        m_pump.Enqueue( new T (FormatExceptionInfo(a_MethodName, a_Exception)));\r\n        //    }\r\n        //}\r\n\r\n        public T ReceiveMessage()\r\n        {\r\n            T l_message;\r\n            lock (this)\r\n            {\r\n                l_message = m_pump.Dequeue();\r\n            }\r\n            return l_message;\r\n        }\r\n    }\r\n}\r\n', 'Message Pump', '2', '2007-11-14 17:45:32.935679', 'DENGLISH', '2007-11-14 17:45:32.935679', 'DENGLISH', 'Y', NULL),
  ('188', '2007-11-16', NULL, NULL, 'using System;\r\n\r\nnamespace Payformance.Common\r\n{\r\n    /// <summary>\r\n    /// This class was taken from the book: "Programming .Net Components"\r\n    /// ISBN-10: 0-596-10207-0\r\n    /// ISBN-13: 978-0-596-10207-4\r\n    /// on page 98: Section: "Deterministic Finalization Template"\r\n    /// </summary>\r\n    public abstract class Disposable : IDisposable\r\n    {\r\n        //=====================================================================\r\n        // PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVA\r\n        // PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVA\r\n        // PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVATE  PRIVA\r\n        //=====================================================================\r\n        private bool m_disposed = false;\r\n\r\n        //=====================================================================\r\n        // PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PR\r\n        // PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PR\r\n        // PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PROTECTED  PR\r\n        //=====================================================================\r\n        protected bool Disposed\r\n        { get { lock( this) { return m_disposed; } } }\r\n\r\n        protected virtual void Cleanup()\r\n        { }\r\n\r\n        //=====================================================================\r\n        // PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBL\r\n        // PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBL\r\n        // PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBLIC  PUBL\r\n        //=====================================================================\r\n\r\n        //=====================================================================\r\n        // Destructor\r\n        // The destructor will run only if Dispose() is not called.  Do not\r\n        // provide destructors in types derrived from this class.\r\n        //=====================================================================\r\n        ~Disposable()\r\n        { Cleanup(); }\r\n\r\n        //=====================================================================\r\n        // The dispose method.\r\n        //=====================================================================\r\n        public void Dispose()\r\n        {\r\n            lock( this)\r\n            {\r\n                //=============================================================\r\n                // Check to see if Dispose() has already been called.\r\n                //=============================================================\r\n                if( m_disposed == false)\r\n                {\r\n                    Cleanup();\r\n                    m_disposed = true;\r\n                    //=========================================================\r\n                    // Take yourself off the finalization queue\r\n                    // to prevent finalization from executing a second time.\r\n                    //=========================================================\r\n                    GC.SuppressFinalize( this);\r\n                }\r\n            }\r\n        }\r\n    }\r\n}\r\n', 'Disposable', '2', '2007-11-16 13:27:42.948288', 'DENGLISH', '2007-11-16 13:27:42.948288', 'DENGLISH', 'Y', NULL),
  ('189', '2007-11-16', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Data;\r\nusing System.Runtime.Serialization;\r\n\r\nnamespace SerializableDataSet\r\n{\r\n    [Serializable]\r\n    public partial class SerializableDataSet\r\n    {\r\n        #region Private Data Members\r\n        private DataSet m_DataSet;\r\n        private List<DataViewState> m_List = new List<DataViewState>();\r\n        #endregion\r\n\r\n        #region Constructor(s)\r\n        public SerializableDataSet()\r\n        {\r\n            m_DataSet = new DataSet();\r\n        }\r\n\r\n        public SerializableDataSet(DataSet a_DataSet)\r\n        {\r\n            m_DataSet = a_DataSet;\r\n        }\r\n        #endregion\r\n\r\n        #region Properties\r\n        public DataSet DataSet\r\n        {\r\n            get { return m_DataSet; }\r\n            set { m_DataSet = value; }\r\n        }\r\n        #endregion\r\n\r\n        #region Event Handlers\r\n        [OnSerializing]\r\n        void OnSerializing(StreamingContext a_Context)\r\n        {\r\n            m_List.Clear();\r\n            for (int i = 0; i < m_DataSet.Tables.Count; i++)\r\n                m_List.Add(new DataViewState(m_DataSet.Tables[i].DefaultView));\r\n\r\n        }\r\n\r\n        [OnDeserialized]\r\n        void OnDeserialized(StreamingContext a_Context)\r\n        {\r\n            if(    (m_List.Count != 0)\r\n                && (m_List.Count != m_DataSet.Tables.Count))\r\n                throw new SerializationException("SerializableDataSet: Something is Wackey in SerializableDataSet''s ''ville.  (TGIS)");\r\n\r\n            for (int j = 0; j < m_List.Count; j++)\r\n                m_List[j].LoadState(m_DataSet.Tables[j].DefaultView);\r\n        }\r\n        #endregion\r\n    }\r\n}\r\n\r\n\r\nusing System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Data;\r\n\r\nnamespace SerializableDataSet\r\n{\r\n    [Serializable]\r\n    public class DataViewState\r\n    {\r\n        protected bool m_bAllowDelete;\r\n        protected bool m_bAllowEdit;\r\n        protected bool m_bAllowNew;\r\n        protected bool m_bApplyDefaultSort;\r\n        protected string m_RowFilter;\r\n        protected string m_Sort;\r\n\r\n        public DataViewState()\r\n        {\r\n        }\r\n\r\n        public DataViewState(DataView a_dv)\r\n        {\r\n            m_bAllowDelete = a_dv.AllowDelete;\r\n            m_bAllowEdit = a_dv.AllowEdit;\r\n            m_bAllowNew = a_dv.AllowNew;\r\n            m_bApplyDefaultSort = a_dv.ApplyDefaultSort;\r\n            m_RowFilter = a_dv.RowFilter;\r\n            m_Sort = a_dv.Sort;\r\n        }\r\n\r\n        public void LoadState(DataView a_dv)\r\n        {\r\n            a_dv.AllowDelete = m_bAllowDelete;\r\n            a_dv.AllowEdit = m_bAllowEdit;\r\n            a_dv.AllowNew = m_bAllowNew;\r\n            a_dv.ApplyDefaultSort = m_bApplyDefaultSort;\r\n            a_dv.RowFilter = m_RowFilter;\r\n            a_dv.Sort = m_Sort;\r\n        }\r\n    }\r\n}', 'Serialize Data Set', '2', '2007-11-16 14:59:06.656506', 'DENGLISH', '2007-11-16 15:01:18.46006', 'DENGLISH', 'Y', NULL),
  ('191', '2007-11-16', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.IO;\r\nusing System.Xml;\r\nusing ICSharpCode.SharpZipLib.Zip;\r\n \r\nnamespace EDIFragmentGui\r\n{\r\n    public class FilterNormalixeXML\r\n    {\r\n        static public void NormalizeXmlFile(string a_FileName)\r\n        {\r\n            string l_TempFileName = a_FileName + "._fmt_xml_temp_";\r\n \r\n            using (FileStream l_InputFileStream = new FileStream(a_FileName, FileMode.Open, FileAccess.Read))\r\n                NormalizeXmlStream(l_TempFileName, l_InputFileStream, true);\r\n \r\n            // Delete the old file\r\n            File.Delete(a_FileName);\r\n \r\n            // Copy the new file to the old filename\r\n            File.Move(l_TempFileName, a_FileName);\r\n        }\r\n \r\n        static public void NormalizeXmlZipFile(string a_ZipFileName)\r\n        {\r\n            if( !a_ZipFileName.ToUpper().EndsWith( ".ZIP"))\r\n                throw new Exception( "FilterNormalizeXml: NormalizeXmlZipFile: Filename must have a .zip extension");\r\n \r\n            using (FileStream l_ZipInputFileStream = new FileStream(a_ZipFileName, FileMode.Open, FileAccess.Read))\r\n            using (ZipInputStream l_ZipInputStream = new ZipInputStream(l_ZipInputFileStream))\r\n            {\r\n                ZipEntry l_ZipEntry = null;\r\n                while ((l_ZipEntry = l_ZipInputStream.GetNextEntry()) != null)\r\n                {\r\n                    string l_OutputFileName = Path.Combine(Path.GetDirectoryName(a_ZipFileName)\r\n                                                          , l_ZipEntry.Name);\r\n \r\n                    NormalizeXmlStream(l_OutputFileName, l_ZipInputStream, false);\r\n                }\r\n            }\r\n        }\r\n \r\n        private static void NormalizeXmlStream(string a_OutputFileName, Stream a_InputStream, bool a_bCloseReader)\r\n        {\r\n            XmlTextReader l_XmlTextReader = null;\r\n            try\r\n            {\r\n                l_XmlTextReader = new XmlTextReader(a_InputStream);\r\n                l_XmlTextReader.WhitespaceHandling = WhitespaceHandling.None;\r\n                using (FileStream l_OutputFileStream = new FileStream(a_OutputFileName, FileMode.CreateNew, FileAccess.Write))\r\n                using (TextWriter l_TextWriter = new StreamWriter(l_OutputFileStream))\r\n                using (XmlTextWriter l_XmlTextWriter = new XmlTextWriter(l_TextWriter))\r\n                {\r\n                    l_XmlTextWriter.Formatting = System.Xml.Formatting.Indented;\r\n                    while (!l_XmlTextReader.EOF)\r\n                        l_XmlTextWriter.WriteNode(l_XmlTextReader, false);\r\n                    l_XmlTextWriter.Flush();\r\n                }\r\n            }\r\n            finally\r\n            {\r\n                if (a_bCloseReader == true)\r\n                    l_XmlTextReader.Close();\r\n            }\r\n        }\r\n    }\r\n}', 'Sax XML Normalization', '2', '2007-11-26 16:49:37.921823', 'DENGLISH', '2007-11-26 16:49:37.921823', 'DENGLISH', 'Y', NULL),
  ('190', '2007-11-26', NULL, NULL, '<book>\r\n\t<book_name>Example Book</book_name>\r\n\t<chapter>\r\n\t\t<chapter_name>Introduction</chapter_name>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Overview</chap_topic_name>\r\n\t\t\t<file_name>overview</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>I have been the vitim of fraud.  My realitor, the title company and the bank that I had a secondary mortgage with conducted themselves in what cumulatively, I believe to be a fradulent house closing.</p>\r\n\t\t\t\t<ol>\r\n\t\t\t\t\t<li>The title company prepared a HUD Settlers Statement that stated that the 2nd mortgage was "Paid Off"</li>\r\n\t\t\t\t\t<li>The document sent from the bank to the title company that released the lein on my property was sent with letterhead the implied that the document was also sent to me.  It was never sent to me.</li>\r\n\t\t\t\t\t<li>The title company witheld the document from my closing packet (which that had to have in their posession to proceed with the sale) to insure that I was not aware that the Bank expected me to pay the balance of the loan.</li>\r\n\t\t\t\t\t<li>My real estate agent (Denise Rodnick) was aware that I could not take a large loss on the sale of the house, and did not report to me that she had the document faxed to her office.  In fact, when I questioned her, she denied knowing that the "lein release" document existed.</li>\r\n\t\t\t\t\t<li>The real estate manager of Century 21 (Larry Harwood) also denied the existence of the document.</li>\r\n\t\t\t\t\t<li>After pressuring the title company many weeks after the sale (when I learned the Bank expected me to pay back the loan), the title company scanned an emailed me the document which my real estate agent knew would have killed the deal if I had seen it before closing.</li>\r\n\t\t\t\t</ol>\r\n\t\t\t\t<p>This account is where I am recording the events that have unfolded with regard to the Sale of <b>30016 Greenboro  Farmington Hills, MI</b> and the fradulent activities that ended up leaving me "responsible" for the current debt of the second mortage payoff.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>A Remote Job</chap_topic_name>\r\n\t\t\t<file_name>introduction_a_remote_job</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>I started working for <b>Payformance Corporation</b> around <b>12/16/2006</b>.  The company was located in Florida.  I worked remotely there until <b>04/14/2007</b>.  The company was aware that I had a house in <b>Michigan</b> that I may or may not be able to sell.  They were interested in my ability to help them achieve some short term goals, and offered me employment in spite of this.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Retaining the Services of Centry 21</chap_topic_name>\r\n\t\t\t<file_name>introduction_retaining_the_services_of_centry_</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>In an effort to consider the possiblity of moving to Florida, I approached the <b>Century 21</b> real estate office located at <b>30110 Orchard Lake Road, Farmington Hills MI, 48334</b> whose phone number is <b>(248) 851-6700</b>.  I walked in and found <b>Larry Harwood</b> (the office manager) and <b>Mark Parker</b> (a real estate agent) at the front desk.  I explained to them that I had an potential opertunity to escape the declining economy im Michigan, but stipulated that I could not take a loss on the recently purchased property.  (30016 Greenboro, Farmington Hills, MI  48334)</p>\r\n\t\t\t\t<p>I told them that in case I could not get a sale without debt, that I would return the property in 1 years time.  I told them that I was not in a financial position to take a loss on the property, but said that I was going to "try out" the market.  I presented this to him as the criteria for sale, and offered them to try to sell the property if he understood my goals.  <b>Larry Harwood</b> responded by saying "It sounds like you want to test out the market in which case you may as well use us."  <b>Mark Parker</b> was witness to the conversation on our first initial meeting.  <b>Larry</b> said that <b>Mark Parker</b> was his leading seller, and that he would assign the property to him.</p>\r\n\t\t\t\t<p>We made an appointment to meet <b>Mark Parker</b> in the following days at the property (30016 Greenboro) at which time we would evaluate the house, the property and evaluate what I expected to get vs. what the market would bear.  I believe we settled on an asking price of <b>265,000$</b>.</p>\r\n\t\t\t\t<p>At this time, <b>Mark Parker</b> told me that there was a selling facility availible to sellers in declining markets called a <b>Short Sale</b>.  He explained that he had participated in the process with other sellers and that the bank would consider taking a loss on the property in cases where the equity of the purchase price was no longer in the house due to a declining market, and that the seller would be given a <b>1099</b> to reflect the banks loss as capitol income.  We decided that we would explore this option if we could not get the full asking price.</p>\r\n\t\t\t\t<p>I also called the lawyer who had helped with the closing of the house when I purchased it: <b>Ann Howard  29777 Telegraph Rd # 2425,  Southfield, MI  48034</b>.  Her phone number is <b>(248) 356-6162</b>.  She explained that the short sale was very simple, and that the bank would simply <b>1099</b> me to reflect the banks loss as capitol income.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t</chapter>\r\n\t<chapter>\r\n\t\t<chapter_name>The Sale</chapter_name>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Researching a Short Sale Option</chap_topic_name>\r\n\t\t\t<file_name>introduction_researching_a_short_sale_option</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>I called <b>Chase Manhatten Bank</b> sometime in December or January.  I started by calling my local bank where I talked to <b>?</b>.  He was a customer service rep that I had worked with many times in the past.  He told me that he was not familiar with the process, but agreed to research it for me.  I never heard from him again regarding the matter.  I believe that he did give me some phone numbers, and ultimately I reached someone on the phone who could help me.  They explained a few things about the short sale process.</p>\r\n\t\t\t\t<ol>\r\n\t\t\t\t\t<li>I was asked to write a <b>Letter of Financial Hardship</b> and fax it to a number.</li>\r\n\t\t\t\t\t<li>Send in two years tax returns.</li>\r\n\t\t\t\t\t<li>?</li>\r\n\t\t\t\t</ol>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t</chapter>\r\n\t<chapter>\r\n\t\t<chapter_name>Initiating the Short Sale Option</chapter_name>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Realization of two loans</chap_topic_name>\r\n\t\t\t<file_name>initiating_the_short_sale_option_realization_of_two_loans</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>Not hearing any information to the contrary, I assumed that the conditions for being considered for a short sale were the same for both my primary and secondary loans.  When I called representitives from both loans, I learned that the only the primary loan required the extensive application, and that the secondary loan just required notification that I was attempting a short sale.</p>\r\n\t\t\t\t<p>So I complied with both requested and sent the requested materials to the fax numbers.  From the very beginning, I was very dissapointed in the Banks ability to communicate with me regarding the matter.  Every follow up I did regarding the sent documentation resulted in very long phone conversations getting routed from department to department.</p>\r\n\t\t\t\t<p>In almost every case, I was never able to speak to anyone who would be handling the matter, much less discuss the terms of the loan agreement regarding the <b>short sale</b>.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Proceeding With A Buyer</chap_topic_name>\r\n\t\t\t<file_name>initiating_the_short_sale_option_trying_to_contact_the_bank</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>It soon became aparent that the asking price was too high.  We decided that we had to lower the price to <b>249,900$</b>.</p>\r\n\t\t\t\t<p>After the reduction in price, <b>Mark Parker</b> soon had two offers for the house.  Both were around <b>225,000</b> after including buyers concessions.  We wanted to move quickly and get Bank approval as soon as possible before the buyers lost interest in the property.  I very quickly turned my attention to contacting the Bank.  I must have called them 15 times, and almost never got anyone on the phone that wasn''t a voice mail.  I pleaded with the Banks short sale department saying it was imperitive that I talk to the person who would be approving the short sale. After all, I needed to find out what the conditions of the short sale approval would be.</p>\r\n\t\t\t\t<p>The Bank would NEVER, EVER call me back regarding the short sale.  In the end, the approval for the short sale was done behind my back.  It was faxed to the Century 21 real estate agency unknown to me, and facilitated the title company with the lein release the needed to prepare the short sale.  Although I never received the document, it was sent to the title company on letter head as though it were sent to me directly, which it never was.  The letter was even adressed to me.  I also believe this to be fradulent.  The letter is shown here:</p>\r\n\t\t\t\t<image>\r\n\t\t\t\t\t<image_name>C:\\Backup\\2007\\200711\\20071126\\images\\letter_from_bank.gif</image_name>\r\n\t\t\t\t\t<image_descr>Note that this letter was sent as though I was also notified with the address at the top.  In fact, I was the only person to not even be aware of it''s existence.</image_descr>\r\n\t\t\t\t</image>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>The Problem</chap_topic_name>\r\n\t\t\t<file_name>initiating_the_short_sale_option_the_problem</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>My real estate agent at the time <b>Denise Rodnick</b> was well aware that I would not agree to be responsible for the balance of the loan.  It is something we had discussed many, many times on the phone.  She also knew that I had never received any response from the Bank regarding the matter.  I believe the Bank was directly responsible for me not seeing the document.  After all, the letter "suggests" that the letter had been sent to me.  Scott Algayer admitted this to me on a phone conversation on <b>10/11/2007</b>.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t</chapter>\r\n\t<chapter>\r\n\t\t<chapter_name>Closing Time</chapter_name>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>The Title Company Closing Packet</chap_topic_name>\r\n\t\t\t<file_name>closing_time_the_title_company_closing_packet</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>The title company sent me the closing papers around <b>08/11/2007</b> an we had an understanding that  I would return the packet the following day.  We felt there was a great deal of pressure to close the deal because the buyers <b>Jamalya Stewart</b> had been waiting months for the approval of the short sale.</p>\r\n\t\t\t\t<p>In any case, not hearing any official from the bank regarding the terms of the short sale, I eagerly scanned the documents for any information regarding the short sale.  The only document that pertained to the matters was the "Sellers Statement" which contained the following line:</p>\r\n\t\t\t\t<pre>\r\nPayoff 2nd mtg                                        14,400.00\r\n</pre>\r\n\t\t\t\t<p>(the fifth ? line) of the document.  Naturally, I assumed that the loan had been indeed paid off, and for that reason decided to proceed with the loan.  It is important to understand that this was the <b>ONLY</b> communication I had recieved on the matter from either the:</p>\r\n\t\t\t\t<ul>\r\n\t\t\t\t\t<li>Bank</li>\r\n\t\t\t\t\t<li>Real Estate Agency (Centry 21)</li>\r\n\t\t\t\t\t<li>Title Company</li>\r\n\t\t\t\t</ul>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t</chapter>\r\n\t<chapter>\r\n\t\t<chapter_name>Following Up</chapter_name>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Extensive Attempts To Contact the Bank</chap_topic_name>\r\n\t\t\t<file_name>following_up_extensive_attempts_to_contact_the_bank</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>I tried calling the <b>Bank</b> approximately 10 - 15 times regarding the matter.  In the case of <b>Chase Manhatten</b>, almost no matter where I called, I got forwarded to extensions that only had voice mail.  I don''t recall ever getting a call from any of my messages pleading that someone called me regarding the matter.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Primary Loan</chap_topic_name>\r\n\t\t\t<file_name>following_up_primary_loan</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>Sometime in <b>June</b> I was contacted by <b>?</b> who was responsible for giving me the official response of the primary loan reuqest for short sale.  She said one thing over and over:</p>\r\n\t\t\t\t<p>"We will only consider a short sale with regard to your primary loan if you get the secondary lein holders to settle their loan for <b>1000$</b>.  I had assumed that a short sale loss would have been distributed across the loans in proportion to the loan amounts.  I further assumed that this meant that I could not sell my house.</p>\r\n\t\t\t\t<p>I called the real estate agent <b>Denise Rodnick</b> and explained that since the primary was unable to budge, that I would not be able to sell the house.</p>\r\n\t\t\t\t<p><b>Denise Rodnick</b> went on to explain that the Bank was simply telling me that since as the primary lein holder, they were entitled to settlement before the secondary lein holder, and that was the bank''s way of saying that I simply had to negotiate with the secondary lein holder.  She said that this was to be expected becuase the offer on the hose, and the associated loss did not exceed the secondary loan amount.</p>\r\n\t\t\t\t<p>Further, she explined, that the <b>Bank</b> would negotiate with me, and accept a fraction of what was owed.  She also said, that if negotiations could not be reached, the the Bank would simply write me off for a loss and 1099 me, in which case I may have to pay the taxes as it could be considered capital income.  I continued to explain to here, that in any case, I could not sustain any more financial obligation other then the potential taxes that would be due because of a potential <b>1099</b>.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t</chapter>\r\n\t<chapter>\r\n\t\t<chapter_name>Getting A Bill</chapter_name>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Shock</chap_topic_name>\r\n\t\t\t<file_name>getting_a_bill_shock</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>Although the loan had been "paid off" (as the settlers staetement stipulated), Sometime in September 2007, I recieved a "late notice" from the bank on my montly secondary loan payment.  I was horrified at the prospect that this was in fact the case, and IMMEDIATELY called <b>Chase Manhatten</b> bank.  I got a customer service rep on the line who explained that the loan had a large principal payment, but in fact was active.  I explained that this was a short sale, and that the loan had been paid off, and that I understood that I was in no way responsible for the loan.  He agreed, and said that I was not responsible for the loan, and that I could disregard the notice.  I believe I asked the name of the customer service rep, and wrote it down, but have since misplaced the information.</p>\r\n\t\t\t\t<p>At this point, I considered the matter settled and decided I did not take any further action.  After all, this is the first time I got the bank to admit that the loan had been paid off.</p>\r\n\t\t\t\t<p>However, <b>Chase Manhatten</b> continued to harass me regarding the loan.  I recieved the first to two letters which stipulated that the loan has been unsettled, and that the bank had not heard anything from me regarding the matter and has been unsuccessful in their attempts at contatacting me.  This was not the case.</p>\r\n\t\t\t\t<p>My wife received a call from a Bank "Loss Department" regarding the balance of the secondary mortgage.  She was alarmed at the prospect of being responsible for the loan, and was very panicked when she called.  That evening, I called the person handling the case, and explained that I had documentation which stated that I did not receive the loan.  She asked that I fax the documentation to here which I did (sometime in late September or October).  I asked here for her phone number where I could get ahold of her and a fax number.  In my alarm, I got the fax number, but ended the call before I realized that I did not get a phone number.  When I faxed the document, I also faxed a request that she contact me and verify that the documentation was recieved, and that the matter was closed.  Again, there was no reponse from the Bank.</p>\r\n\t\t\t\t<p>I considered that matter settled.  In time, we recived another call from the same person.  This time I was shocked.  It seems that no matter how hard I try to resolve the situation, there is never any response, but a slow steady harassment.  I asked if she had gotten my fax.  She said she didn''t but proceeded to ask me what I had sent.  I told here that the Settlers Statement stated in no uncertian terms that the loan had been paid off.  She replied with: "Oh, that just the HUD settlers statment, and that is the terminology they use.  I can tell you for certian that the loan was not paid off, and that you are responsible for the balance.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Denise Rodnick''s Reaction</chap_topic_name>\r\n\t\t\t<file_name>getting_a_bill_denise_rodnicks_reaction</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>When I first learned that the bank expected me to pay back the loan, I immediately called Denise Rodnick and explined that I fealt that there must have been some fradulent activities becuase of the bill I was expected to pay.  I was shocked to hear her say that I should try to negotiate the debt.  This was a complete turn around for the conditions I had laid out to Centry 21 regarding the sale of the home.  I had reminded her of the statements she made to me regarding the expected <b>1099</b> that I would have been potentially been responsible, and she seemed a bit casual, and responded with "oh well".</p>\r\n\t\t\t\t<p>I told her that I considered some fraud regarding the handling of the closing.  She said that she was not threatened by my conclusion becuase she the offices was insured in case any mistakes have been made.  She re-iterated that with her business relationship as an agent of Century 21, that she was protected via some insurance.</p>\r\n\t\t\t\t<p>However, Denise and I had developed a fairly cordial business relationship, and she offered to allow me to talk to here husband that just happened to be a real estate lawyer.  He told me that I had a few options.  Trying to recall them I believe they were:</p>\r\n\t\t\t\t<ul>\r\n\t\t\t\t\t<li>Declare Chapter 7, and the matter would be over.</li>\r\n\t\t\t\t\t<li>Try to negotiate with the bank.</li>\r\n\t\t\t\t\t<li>Tell them to stuff it (or some other colerful metaphor) and see what happens.</li>\r\n\t\t\t\t</ul>\r\n\t\t\t\t<p>He also indicated that I should ignore the letters until I had a "Default Judgement" regarding the matter.</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>The Witheld Document</chap_topic_name>\r\n\t\t\t<file_name>getting_a_bill_talking_to_a_lawyer</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>I called the Lawyer that I had used the the closing of the house when we purchased it. Her name is Ann Howard (add address and phone number).  When I explained the situation, she told me that the title company must have recieved a document from <b>Chase Manhatten</b> bank that allowed them to prepare the closing documents.  She indicated that I needed to seek out this document, and find out EXACTLY what it said.</p>\r\n\t\t\t\t<p>I think I again called <b>Denise Rodnick</b> and asked exactly how the clearance was given by the bank authorizing the title company to clase the deal.  Se said that she was not aware of exactly what had been sent to achieve this, and stated that it transpired between the title company and the Bank.</p>\r\n\t\t\t\t<p>I started to press the title company about the existance of the document through email, and this was exactly what was sent back and fourth:</p>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Contacting The Title Company</chap_topic_name>\r\n\t\t\t<file_name>getting_a_bill_contacting_the_title_company</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: May, Lakisha [mailto:lmay@LANDAM.com] \r\nSent: Wednesday, October 10, 2007 4:57 PM\r\nTo: Dave English\r\nSubject: RE: A closing mis-represented.\r\n\t\t</pre>\r\n\t\t\t\t<p>Please forward the rest of your emails to <a href="MarciPowers@landam.com">MarciPowers@landam.com</a> or call her at 734-524-1640.</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: Dave English [mailto:Dave_English@payformance.com] \r\nSent: Wednesday, October 10, 2007 4:51 PM\r\nTo: May, Lakisha\r\nCc: c21mwz@aol.com\r\nSubject: A closing mis-represented.\r\nImportance: High\r\n</pre>\r\n\t\t\t\t<p>Lakisha,</p>\r\n\t\t\t\t<p>How do I know what is NOT included.  The Sellers Settlement Statement says (exactly)</p>\r\n\t\t\t\t<pre>\r\nPayoff 2nd mtg                                                                14,400.00\r\n</pre>\r\n\t\t\t\t<p>Your company had a copy of the document, why was it not included in the closing papers?  I really don''t care that the individual that prepared the closing is no longer with the company.  She represented the company, and that''s all that matters.  Now the company will be responsible.</p>\r\n\t\t\t\t<p>If the verbiage Payoff 2nd mtg had been wrong, and the document present, or the document missing, and verbiage correct  (such as)</p>\r\n\t\t\t\t<pre>\r\nRelease Lien on 2nd mtg                                                    14,400.00\r\n</pre>\r\n\t\t\t\t<p>Then I would would not say what I am about to.</p>\r\n\t\t\t\t<p>I believe this is a clear attempt to mislead me in believing that the 2nd mortgage was PAID OFF (i.e. verbiage "Payoff").  The fact of the matter is, that had I seen this document, it would have been a DEAL BREAKER.  I cannot and will not be liable for the balance.  I intend to pursue the culprit of this action against me to the fullest extend of the law.</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: May, Lakisha [mailto:lmay@LANDAM.com] \r\nSent: Wednesday, October 10, 2007 4:42 PM\r\nTo: Dave English\r\nSubject: RE:\r\n</pre>\r\n\t\t\t\t<p>Did you not question this when you signed the documents?  </p>\r\n\t\t\t\t<p>The closer''s name was Shelley who is no longer with the company.  The manager''s name is Marci Powers and her number is 734-524-1640.</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: Dave English [mailto:Dave_English@payformance.com] \r\nSent: Wednesday, October 10, 2007 4:37 PM\r\nTo: May, Lakisha\r\nSubject: RE:\r\nImportance: High\r\n</pre>\r\n\t\t\t\t<p>Lakish,</p>\r\n\t\t\t\t<p>I have never before laid eyes on this document.  Who is the closer?  I just called Larry Harwood''s office, and he said someone at your title company closed.  Could you please give me their email and direct dial number?</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: May, Lakisha [mailto:lmay@LANDAM.com] \r\nSent: Wednesday, October 10, 2007 4:32 PM\r\nTo: Dave English\r\nSubject: RE:\r\n</pre>\r\n\t\t\t\t<p>You need to call the bank who granted you the short sale for the terms.  All of that should have been taken care of prior to us receiving the payoff statement.  It''s not our job to explain the terms of your short sale agreement with your lender because we don''t know what terms was agreed to.</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: Dave English [mailto:Dave_English@payformance.com] \r\nSent: Wednesday, October 10, 2007 4:28 PM\r\nTo: May, Lakisha\r\nSubject: RE:\r\n</pre>\r\n\t\t\t\t<p>Who is the closer?  Who''s responsible for not making me aware of the terms of the Short Sale agreement?</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: May, Lakisha [mailto:lmay@LANDAM.com] \r\nSent: Wednesday, October 10, 2007 4:26 PM\r\nTo: Dave English\r\nSubject: RE:\r\n</pre>\r\n\t\t\t\t<p>I couldn''t tell you why it wasn''t included.  I''m not a closer.  Did you receive a copy of the 1st payoff?</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: Dave English [mailto:Dave_English@payformance.com] \r\nSent: Wednesday, October 10, 2007 4:24 PM\r\nTo: May, Lakisha\r\nSubject: RE:\r\nImportance: High\r\n</pre>\r\n\t\t\t\t<p>Lakisha,</p>\r\n\t\t\t\t<p>Why was this document not in the Closing Papers Packet?</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: May, Lakisha [mailto:lmay@LANDAM.com] \r\nSent: Wednesday, October 10, 2007 4:01 PM\r\nTo: Dave English\r\nSubject: FW:\r\n</pre>\r\n\t\t\t\t<p>My number is 734-524-1640.</p>\r\n\t\t\t\t<pre>\r\n--------------------------------------------------------------------------------\r\nFrom: Vincent, Marianne \r\nSent: Wednesday, October 10, 2007 3:53 PM\r\nTo: May, Lakisha\r\nSubject: What is your phone number?\r\n</pre>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t</chapter>\r\n\t<chapter>\r\n\t\t<chapter_name>Timeline</chapter_name>\r\n\t\t<chap_topic>\r\n\t\t\t<chap_topic_name>Tring to get Resolution</chap_topic_name>\r\n\t\t\t<file_name>bank_contact_tring_to_get_resolution</file_name>\r\n\t\t\t<content>\r\n\t\t\t\t<p>In the timline below, the dates should be fairly accurate and the time in the ballpark.</p>\r\n\t\t\t\t<ol>\r\n\t\t\t\t\t<li><b>8/?/2007</b> - recived "late payment" bill from secondar morgage.  I immediately called <b>Chase Manhatten</b> and after some back and fourth confirmed that the loan had been paid off.  I specifically confirmed that I would not be receiving any more bills for the loan.  The service representative agreed.</li>\r\n\t\t\t\t\t<li><b>10/9/2007</b> - received call from (? - case worker) where she informed me that I was liable for the balance of the loan.  When I told here this was not the case, and that I had papers in my closing packet which stated otherwise, she told me to fax them in.  Otherwise, she said that she would "garnish my wages" to pay off the loan.  I faxed in the "Settlers Statement" which stated that the loan was paid off.  I then faxed in a document asking her to call me at 904.240.0593.  She never did respond.</li>\r\n\t\t\t\t\t<li><b>10/10/2007 13:00</b> - I called from my cell phone (248.207.6151) and left a panicked and angry message on the answering machine of <b>Scott Algayer</b> at <b>(877) 456-1281 ext 27688</b>, the person who authorized the short sale for <b>Chase Morgan</b>.  I told him that I felt like sueing.  I was very angry and agitated at this point at being told that I was responsible for the balance.</li>\r\n\t\t\t\t\t<li><p><b>10/11/2007</b> - <b>Scott Algayer</b> at <b>(877) 456-1281 ext 27688</b> called me on my cell phone (248.207.6151) and said: "Don''t worry, you are not personally responsible for the money.  I can 1099 you right now, if that''s what you want to do."  I told him that I suspected fradulent activity in the handling of the short sale approval.  I was particularly incensed at the fact that the letter sent faxed to Century 21 regarding the release of the lien on the property, and the explicit statement that the borrowers would be liable for the balance was written on letter head as though it were sent to me.  He seemed a little embarassed by this, and said something to the effect of: "Yeah, that''s how this thing is ordinarily handled".</p>\r\n\t\t\t\t\t\t<p>However, in the interest of settleing the matter once and for all, I told him that I was prepared to pay the taxes on the 1099.  I asked if the bank would be interested in reaching a settlement that would be equal to or less then 25% of the loan amount in interest free payments.  He said that they would definetely be interested in that type of settlement.  Further, he added, he would get the case worker (?) on a three way phone coference immediately so we could settle the matter on this phone call.  His attempts of calling her directly were the same as all of my efforts to contact him prior to this: He got a voice mail.  I can''t remember if he left a message or not, but he told me to contact her and that we could resolve the matter immediately.</p>\r\n\t\t\t\t\t</li>\r\n\t\t\t\t\t<li><p><b>10/11/2007 13:30</b> - I immedately called (? - case worker) and left a message. I told her of what Scott said, and asked what the minimum amount they would consider selling for.  The message we never replied to.  I was subsequently told by (?) that she had never gotten the message.  She, or no-one in her place ever responded to the message.</p></li>\r\n\t\t\t\t\t<li><p><b>10/?/2007</b> - I received a message from (? - case worker).  I asked her if she got my faxed message from our conversation on 10/9/2007, or the message I left at <b>10/11/2007</b> regarding settlement.  She said she had not gotten the message, or either fax.  She asked what was the content of the fax, and I told here.  She explained that regardless of the verbiage used on the HUD form, that I was responsible for the loan.  I was so alarmed at this development, that I started having some chest pain.</p>\r\n\t\t\t\t\t\t<p>I again stipulated that I thought the activities by the Bank / Real Estate Agent / Title Company were fradulent.  However, I again agreed in an effort to resolve the situation I offered 25% on the dollar in interest free payments.  When I said this, she informed me that the interest was in fact running on the current loan.  When hearing this, I started getting pains in my chest.</p>\r\n\t\t\t\t\t</li>\r\n\t\t\t\t\t<li><p><b>11/?/2007</b> - I tried for several days to call <b>Scott Algayer</b> at <b>(877) 456-1281 ext 27688</b>.  I believe I was able to leave a message or two, but after a day or two, his voice mail message box was full, and I could not get ahold of him.  I made on last attempt to call him, and he answered the phone.  I explained that we had talked, and that thigs had gone horribly wrong, and the we needed to resolve the situation.  He said that he was on the phone with another customer and would call me back.  Since he had only called me once in response to some 20 messages I left him in the pase, I knew better and stayed on the line.  After about 15 minutes, he came back and was ready to listen.</p>\r\n\t\t\t\t\t\t<p>I explaned that the call from (? - case worker) came as a total shock to me, and explained how I cannot be subjected to this good cop - bad cop routine that I was getting.  I also informed him of the chest pain I suffered a few days before.  He seemed befuddled becuase he understood that I was going to "try to pay the loan back".  I empahtically reminded him about a potential 25% on the dollar interest free payment which I had hoped to settle for - in the interest of simply settling the matter.</p>\r\n\t\t\t\t\t\t<p>I reminded him that he had said that I didn''t owe the money and that he could 1099 me instead.  I told him that I can not take this up and down, not returning calls, loosing faxes and messages, and told him that I wanted to 1099 it.  He said that he was able to "pull" the case from the loss recovery department.  He also said that he was going to get it approved momentarily.  He said that he was Instant Messaging his supervisor and that he would call me as soon as the matter was complete.  As usual, I never heard anythine back.</p>\r\n\t\t\t\t\t</li>\r\n\t\t\t\t\t<li><p><b>11/20/2007 ??</b> - I received another generic form letter from the loss recovery department.  It was again saying that the company was unsuccessful in reaching me to discuss the matter.  At this point, that is simply false.  However, it does show me that I am caught in a procedural recovery process which even the bank itself (or the representatives available to me) seem unable to control.  All attempts at rectifying the situation have failed, and the bank never seems to know what is going to happen.</p></li>\r\n\t\t\t\t\t<li><p><b>11/27/2007 16:00</b> - I called <b>Scott Algayer</b> at <b>(877) 456-1281 ext 27688</b>.  I explained that I thought we had an understanding regarding the balance of the loan as of our last phone conversation.  He said that we did. He read his log entries in his system and explained that he had gotten his supervisors approval to (1099 me ??), but in any case, I should not be getting collection letters from <b>Chase Manhatten</b>.  He was very polite, and asked if there was anything else he could do.</p></li>\r\n\t\t\t\t\t<li><p><b>11/27/2006 18:30</b> I faxed in the copy of the collection letter that Scott Requested.  The fax had a cover sheet that asked for a certified letter explaining that the bank was not going to persue the debt, and that it was in fact going to result in a <b>1099</b> sent to me.  I also asked for <b>Scott Algayer</b> at <b>(877) 456-1281 ext 27688</b> to call me at home confirming he got the fax.</p>\r\n\t\t\t\t\t\t<p style="color: red; font-weight: bold">ATTACH COPY OF FAXED HEADER SHEET AND COPY OF RETURN DOCUMENT</p>\r\n\t\t\t\t\t</li>\r\n\t\t\t\t\t<li><p><b>11/28/2007 16:35 EST</b> - I left a message for <b>Scott Algayer</b> at <b>(877) 456-1281 ext 27688</b> telling him that I faxed in the requested document last night, and that I had requested a certified letter in the fax.  I also requested that he call me to confirm the fax, and the message left today.</p></li>\r\n\t\t\t\t</ol>\r\n\t\t\t</content>\r\n\t\t</chap_topic>\r\n\t</chapter>\r\n\t<terms>\r\n\t\t<term>\r\n\t\t\t<term_name>Term 1</term_name>\r\n\t\t\t<term_label>term1</term_label>\r\n\t\t\t<term_descr>\r\n\t\t\t\t<p>List terms you use in your document here.</p>\r\n\t\t\t</term_descr>\r\n\t\t</term>\r\n\t</terms>\r\n\t<macros>\r\n\t\t<G_COMPANY_LINK><span class="company-link"><a href="http://www.payformance.com">http://www.payformance.com</a></span></G_COMPANY_LINK>\r\n\t\t<G_COMPANY_NAME><span class="company-name">PAYFORMANCE Corporation</span></G_COMPANY_NAME>\r\n\t\t<G_COMPANY_ADDRESS>\r\n\t\t\t<table><tr><td>\r\n\t\t\t\t\t\t<span class="company-address">\r\n\t\t\t\t\t\t\t<m>G_COMPANY_NAME</m><br/>\r\n\t\t\t\t\t10550 Deerwood Park Blvd, Bldg 300<br/>\r\n                    Jacksonville, Florida 32256-8017<br/>\r\n\t\t\t\t\t\t\t<m>G_COMPANY_LINK</m>\r\n\t\t\t\t\t\t</span>\r\n\t\t\t\t\t</td></tr></table>\r\n\t\t</G_COMPANY_ADDRESS>\r\n\t\t<HTML_HEADER>\r\n\t\t\t<TAG_BEGIN>html</TAG_BEGIN>\r\n\t\t\t<head>\r\n\t\t\t\t<title>David English Document</title>\r\n\t\t\t</head>\r\n\t\t\t<TAG_BEGIN>body</TAG_BEGIN>\r\n\t\t\t<link rel="stylesheet" type="text/css" href="help_styles.css"/>\r\n\t\t\t<style type="text/css">\r\n.err-msg\r\n{\r\n\tcolor:\t\t\t\tdarkRed;\r\n\tfont-weight:\t\tbold;\r\n}\r\n.comment-text\r\n{\r\n\tcolor:\t\t\t\tdarkRed;\r\n\tfont-weight:\t\tbold;\r\n}\r\n.explanation-text\r\n{\r\n\tcolor:\t\t\