-top : 3px solid #ff3333;\r\n\tborder-right: 3px solid #cc0000;\r\n\tborder-bottom : 3px solid #cc0000;\r\n\tmargin-top: 10px;\r\n}\r\n.copyright-bottom-page\r\n{\r\n\tmargin-top:\t\t\t12px;\r\n\tpadding:\t\t\t6px;\r\n\tborder:\t\t\t\t2px solid black;\r\n\tfont-size:\t\t\t7pt;\r\n\tfont-family:\t\tArial;\r\n}\r\n</style>\r\n\t\t</HTML_HEADER>\r\n\t\t<HTML_FOOTER>\r\n\t\t\t<TAG_END>body</TAG_END>\r\n\t\t\t<TAG_END>html</TAG_END>\r\n\t\t</HTML_FOOTER>\r\n\t\t<HTML_HELP_HEADER>\r\n\t\t\t<m>HTML_HEADER</m>\r\n\t\t</HTML_HELP_HEADER>\r\n\t\t<HTML_HELP_FOOTER>\r\n\t\t\t<div align="center">\r\n\t\t\t\t<table>\r\n\t\t\t\t\t<tr>\r\n\t\t\t\t\t\t<td align="CENTER">\r\n\t\t\t\t\t\t\t<div class="copyright-bottom-page">\r\n\t\t\t\t\t\t\t\tCopyright (c) 2006.  <m>G_COMPANY_NAME</m>.  <m>G_COMPANY_LINK</m>\r\n\t\t\t\t\t\t\t</div>\r\n\t\t\t\t\t\t</td>\r\n\t\t\t\t\t</tr>\r\n\t\t\t\t</table>\r\n\t\t\t</div>\r\n\t\t\t<m>HTML_FOOTER</m>\r\n\t\t</HTML_HELP_FOOTER>\r\n\t</macros>\r\n</book>\r\n', 'Bank Letter', '2', '2007-11-26 14:16:16.562586', 'DENGLISH', '2007-11-28 17:03:31.240264', 'DENGLISH', 'Y', NULL),
  ('192', '2007-11-16', NULL, NULL, 'using System;\r\nnamespace Payformance.IndependentCode\r\n{\r\n    public abstract class Closeable : Disposable\r\n    {\r\n        public void Close()\r\n        { Cleanup(); }\r\n\r\n        protected override void Cleanup()\r\n        { base.Cleanup(); }\r\n    }\r\n}', 'Closable', '2', '2007-11-26 16:54:16.112074', 'DENGLISH', '2007-11-26 16:55:08.675316', 'DENGLISH', 'Y', NULL),
  ('194', '2007-11-17', NULL, NULL, '    public class Buffer\r\n    {\r\n        private static readonly int m_roBufferSize = 1000;\r\n        private readonly byte[] m_Buffer = new byte[m_roBufferSize];\r\n        protected int m_Size;\r\n\r\n        public byte[] Bytes\r\n        { get { return m_Buffer; } }\r\n\r\n        public int MaxSize\r\n        { get { return m_roBufferSize; } }\r\n\r\n        public int Size\r\n        { get { return m_Size; } }\r\n    }\r\n    public class ReadWriteBuffer : Buffer\r\n    {\r\n        public int Read(BinaryReader a_Stream)\r\n        {\r\n            m_Size = a_Stream.Read(Bytes, 0, MaxSize);\r\n            return m_Size;\r\n        }\r\n\r\n        public void Write(BinaryWriter a_BinaryWriter)\r\n        {\r\n            a_BinaryWriter.Write(Bytes, 0, Size);\r\n        }\r\n    }\r\n', 'Buffer', '2', '2007-11-26 17:00:21.98336', 'DENGLISH', '2007-11-26 17:00:21.98336', 'DENGLISH', 'Y', NULL),
