  ('196', '2007-11-27', NULL, NULL, '    public class FormChangeCursor : IDisposable\r\n    {\r\n        private Form m_form;\r\n        private Cursor m_oldCursor;\r\n\r\n        public FormChangeCursor(Form l_form, Cursor a_newCursorType)\r\n        {\r\n            m_form = l_form;\r\n            m_oldCursor = m_form.Cursor;\r\n            m_form.Cursor = a_newCursorType;\r\n        }\r\n\r\n        #region IDisposable Members\r\n        public void Dispose()\r\n        {\r\n            m_form.Cursor = m_oldCursor;\r\n        }\r\n        #endregion\r\n    }\r\n    public class FormWaitCursor : FormChangeCursor\r\n    {\r\n        public FormWaitCursor(Form a_form)\r\n            : base(a_form, Cursors.WaitCursor)\r\n        { }\r\n    }\r\n', 'Using Cursor', '2', '2007-11-26 17:52:39.400903', 'DENGLISH', '2007-11-26 17:52:39.400903', 'DENGLISH', 'Y', NULL),
  ('193', '2007-11-17', NULL, NULL, '    class HttpUtils\r\n    {\r\n        public static void ThrowIfIllegalType(Uri a_Uri)\r\n        {\r\n            if(    (!a_Uri.Scheme.Equals("http"))\r\n                && (!a_Uri.Scheme.Equals("file")))\r\n                throw new HCAPException("** UNEXPECTED ERROR: Only using \\"http\\" or \\"file\\" schemes.  Not accepting " + a_Uri.Scheme + " Scheme type.");\r\n        }\r\n    }\r\n    public class HttpRequest : Closeable\r\n    {\r\n        #region Private Member Variables\r\n        private Uri m_Uri;\r\n        private HttpWebRequest m_HttpWebRequest = null;\r\n        private HttpWebResponse m_HttpWebResponse = null;\r\n        private HttpStatusCode m_HttpStatusCode;\r\n        private bool m_bRequestedRangeNotSatisfiable = false;\r\n        #endregion\r\n\r\n        #region Constructor(s)\r\n        public HttpRequest(Uri a_Uri, string a_Method)\r\n        : this( a_Uri, a_Method, 0, 0)\r\n        {\r\n        }\r\n        \r\n        public HttpRequest(Uri a_Uri, string a_Method, int a_BeginByte, int a_EndByteIncluding)\r\n        {\r\n            Debug.Assert(!a_Uri.IsFile);\r\n\r\n            m_Uri = a_Uri;\r\n\r\n            m_HttpWebRequest = WebRequest.Create(a_Uri) as HttpWebRequest;\r\n            Debug.Assert(m_HttpWebRequest != null);\r\n            m_HttpWebRequest.Method = a_Method;\r\n            Debug.Assert(a_BeginByte >= 0);\r\n            Debug.Assert(a_EndByteIncluding >= 0);\r\n            Debug.Assert(a_BeginByte <= a_EndByteIncluding);\r\n            if( a_EndByteIncluding != 0)\r\n                m_HttpWebRequest.AddRange(a_BeginByte, a_EndByteIncluding);\r\n\r\n            if (a_EndByteIncluding != 0)\r\n            {\r\n                try\r\n                {\r\n                    m_HttpWebResponse = m_HttpWebRequest.GetResponse() as HttpWebResponse;\r\n                    Debug.Assert(m_HttpWebResponse != null);\r\n                    m_HttpStatusCode = m_HttpWebResponse.StatusCode;\r\n                }\r\n                catch (WebException l_WebException)\r\n                {\r\n                    if (l_WebException.Message.IndexOf("(416)") != -1)\r\n                    {\r\n                        m_HttpStatusCode = HttpStatusCode.PartialContent;\r\n                        m_bRequestedRangeNotSatisfiable = true;\r\n                    }\r\n                    else\r\n                        throw;\r\n                }\r\n            }\r\n            else\r\n            {\r\n                m_HttpWebResponse = m_HttpWebRequest.GetResponse() as HttpWebResponse;\r\n                Debug.Assert(m_HttpWebResponse != null);\r\n                m_HttpStatusCode = m_HttpWebResponse.StatusCode;\r\n            }\r\n        }\r\n        #endregion\r\n\r\n        #region Properties\r\n        public HttpStatusCode StatusCode\r\n        { get { return m_HttpStatusCode; } }\r\n\r\n        public Stream ResponseStream\r\n        { get { return m_HttpWebResponse.GetResponseStream(); } }\r\n        \r\n        public long ContentLength\r\n        { get { return m_HttpWebResponse.ContentLength; } }\r\n\r\n        public string ContentType\r\n        { get { return m_HttpWebResponse.ContentType; } }\r\n\r\n        public bool RequestedRangeNotSatisfiable\r\n        { get { return m_bRequestedRangeNotSatisfiable; } }\r\n        #endregion\r\n\r\n        #region Methods\r\n        protected string InterpreteResponseCode(string s)\r\n        { return s; }\r\n        #endregion\r\n\r\n        #region Disposable Implementation\r\n        protected override void Cleanup()\r\n        {\r\n            if (m_HttpWebResponse != null) m_HttpWebResponse.Close();\r\n            base.Cleanup();\r\n        }\r\n        #endregion\r\n    }\r\n    public class HttpReader : HttpRequest\r\n    {\r\n        #region Private Member Variables\r\n        protected Stream m_Stream = null;\r\n        #endregion\r\n\r\n        #region Constructor(s)\r\n        public HttpReader(Uri a_Uri, int a_BeginByte, int a_EndByteIncluding)\r\n        : base( a_Uri, "GET", a_BeginByte, a_EndByteIncluding)\r\n        {\r\n            if(    (StatusCode == HttpStatusCode.OK)\r\n                || ((a_EndByteIncluding > 0)\r\n                     && (StatusCode == HttpStatusCode.PartialContent)))\r\n            {\r\n                if (!RequestedRangeNotSatisfiable)\r\n                    m_Stream = ResponseStream;\r\n            }\r\n            else\r\n                throw new HCAPException("Illegal Response Code: " + InterpreteResponseCode(StatusCode.ToString()));\r\n        }\r\n\r\n        public int Read(byte[] a_Buffer, int a_Offset, int a_Count)\r\n        { return m_Stream.Read( a_Buffer, a_Offset, a_Count); }\r\n\r\n        public HttpReader(Uri a_Uri)\r\n        : base( a_Uri, "GET")\r\n        {\r\n            if (StatusCode != HttpStatusCode.OK)\r\n                throw new HCAPException("Illegal Response Code: " + InterpreteResponseCode(StatusCode.ToString()));\r\n\r\n            m_Stream = ResponseStream;\r\n        }\r\n        #endregion\r\n\r\n        #region Properties\r\n        #endregion\r\n\r\n        #region Disposable Implementation\r\n        protected override void Cleanup()\r\n        {\r\n            if (m_Stream != null) m_Stream.Close();\r\n            base.Cleanup();\r\n        }\r\n        #endregion\r\n    }\r\n    public class HttpWriter : Closeable //where T : class, IDisposable, new ()\r\n    {\r\n        #region Private Member Variables\r\n        private Uri m_Uri;\r\n        private HttpWebRequest  m_HttpWebRequest = null;\r\n        private HttpWebResponse m_HttpWebResponse = null;\r\n        private HttpStatusCode  m_HttpStatusCode;\r\n        private Stream m_Stream;\r\n        #endregion\r\n\r\n        #region Constructor(s)\r\n        public HttpWriter(Uri a_Uri, long a_ContentLength, string a_ContentType)\r\n        {\r\n            Debug.Assert(!a_Uri.IsFile);\r\n\r\n            m_Uri = a_Uri;\r\n            \r\n            m_HttpWebRequest = WebRequest.Create(a_Uri) as HttpWebRequest;\r\n            Debug.Assert(m_HttpWebRequest != null);\r\n\r\n            m_HttpWebRequest.Method = "PUT";\r\n            m_HttpWebRequest.ContentLength = a_ContentLength;\r\n            m_HttpWebRequest.ContentType = a_ContentType;\r\n            m_HttpWebRequest.Timeout = 3600000; // One hour.\r\n\r\n            m_Stream = m_HttpWebRequest.GetRequestStream();\r\n        }\r\n        #endregion\r\n\r\n        #region Properties\r\n        public Stream ResponseStream\r\n        { get { return m_Stream; } }\r\n        #endregion\r\n\r\n        #region Methods\r\n        public void Flush()\r\n        {\r\n            HttpWebResponse l_WebResponse = null;\r\n            try\r\n            {\r\n                l_WebResponse = m_HttpWebRequest.GetResponse() as HttpWebResponse;\r\n            }\r\n            catch (WebException l_WebException)\r\n            {\r\n                throw new HCAPException("Error Getting Response", l_WebException);\r\n            }\r\n\r\n            m_HttpStatusCode = l_WebResponse.StatusCode;\r\n        }\r\n\r\n        private string InterpreteResponseCode(string s)\r\n        { return s; }\r\n        #endregion\r\n\r\n        #region Disposable Implementation\r\n        protected override void Cleanup()\r\n        {\r\n            if (m_Stream != null) m_Stream.Close();\r\n            if (m_HttpWebResponse != null) m_HttpWebResponse.Close();\r\n            base.Cleanup();\r\n        }\r\n        #endregion\r\n    }\r\n    public class Reader_Stream : Closeable\r\n    {\r\n        private HttpReader m_HttpReader = null;\r\n        private FileStream m_FileStream = null;\r\n        private Stream m_Stream = null;\r\n\r\n        public Reader_Stream(Uri a_Uri)\r\n        {\r\n            HttpUtils.ThrowIfIllegalType(a_Uri);\r\n            if (a_Uri.Scheme.Equals("http"))\r\n            {\r\n                m_HttpReader = new HttpReader(a_Uri);\r\n                m_Stream = m_HttpReader.ResponseStream;\r\n            }\r\n            else\r\n            {\r\n                m_FileStream = new FileStream(a_Uri.LocalPath, FileMode.Open, FileAccess.Read);\r\n                m_Stream = m_FileStream;\r\n            }\r\n        }\r\n\r\n        public Stream Stream\r\n        { get { return m_Stream; } }\r\n\r\n        protected override void Cleanup()\r\n        {\r\n            if (m_Stream != null) m_Stream.Close();\r\n            if (m_FileStream != null) m_FileStream.Close();\r\n            if (m_HttpReader != null) m_HttpReader.Close();\r\n            base.Cleanup();\r\n        }\r\n    }\r\n    public class Writer_Stream : Closeable\r\n    {\r\n        private HttpWriter m_HttpWriter = null;\r\n        private FileStream m_FileStream = null;\r\n        private Stream m_Stream = null;\r\n\r\n        /// <summary>\r\n        /// As well as a Uri, this class needs the Content-Length and Content-Type\r\n        /// HTTP Headers set.  Since it''s a header it needs to be set first.\r\n        /// \r\n        /// This class is also designed to have the Dispose Method called\r\n        /// </summary>\r\n        /// <param name="a_Uri">The URI where things will get written (posted) to on the Flush cleanup.</param>\r\n        /// <param name="a_ContentLength"></param>\r\n        /// <param name="a_ContentType"></param>\r\n        public Writer_Stream(Uri a_Uri, long a_ContentLength, string a_ContentType)\r\n        {\r\n            HttpUtils.ThrowIfIllegalType(a_Uri);\r\n            if (a_Uri.Scheme.Equals("http"))\r\n            {\r\n                m_HttpWriter = new HttpWriter(a_Uri, a_ContentLength, a_ContentType);\r\n                m_Stream = m_HttpWriter.ResponseStream;\r\n            }\r\n            else\r\n            {\r\n                m_FileStream = new FileStream(a_Uri.LocalPath, FileMode.CreateNew, FileAccess.Write);\r\n                m_Stream = m_FileStream;\r\n            }\r\n        }\r\n\r\n        public Stream Stream\r\n        { get { return m_Stream; } }\r\n\r\n        protected override void Cleanup()\r\n        {\r\n            if (m_Stream != null) m_Stream.Close();\r\n            if (m_FileStream != null) m_FileStream.Close();\r\n            if (m_HttpWriter != null)\r\n            {\r\n                m_HttpWriter.Flush();\r\n                m_HttpWriter.Close();\r\n            }\r\n            base.Cleanup();\r\n        }\r\n    }\r\n            // This keeps track of URL;s that we''ve scanned\r\n            SortedDictionary<string, Uri> m_URLsFound = new SortedDictionary<string,Uri> ();\r\n            \r\n            // Create a starting point, and then add it to the list of URLs to process.\r\n            string l_StartingUrl = "http://yp.yahoo.com/ypResults.py?stp=y&stx=96102147&city=Jacksonville&state=FL&uzip=32202&msa=3600&slt=30.332239&sln=-81.656197&cs=4";\r\n            Uri l_NextUri = new Uri (l_StartingUrl);\r\n            Dequeue<Uri> l_ListToProcess = new Dequeue<Uri>();\r\n            l_ListToProcess.PushBack(l_NextUri);\r\n\r\n            while( l_ListToProcess.HasItems)\r\n            {\r\n                Console.Out.WriteLine("Scanning Page: (" + l_ListToProcess.Count + "): " + l_NextUri.AbsoluteUri);\r\n                l_NextUri = l_ListToProcess.PopFront();\r\n                if (!m_URLsFound.ContainsKey(l_NextUri.AbsoluteUri))\r\n                {\r\n                    List<Uri> l_list = WebCrawl(l_NextUri);\r\n                    l_ListToProcess.PushBack(l_list);\r\n                    Console.Out.WriteLine("Adding: " + l_list.Count);\r\n                }\r\n                else\r\n                    Console.Out.WriteLine("Rejected: " + l_NextUri.AbsoluteUri);\r\n            }\r\n', 'Http Streams', '2', '2007-11-26 16:58:51.350521', 'DENGLISH', '2007-11-27 09:22:14.186209', 'DENGLISH', 'Y', NULL),
