  ('198', '2008-01-29', NULL, NULL, 'using System;\r\nusing System.Text;\r\nusing System.Security.Cryptography;\r\n\r\nnamespace Utilities\r\n{\r\n    /// <summary>\r\n    /// This class generates and compares hashes using MD5, SHA1, SHA256, SHA384, \r\n    /// and SHA512 hashing algorithms. Before computing a hash, it appends a\r\n    /// randomly generated salt to the plain text, and stores this salt appended\r\n    /// to the result. To verify another plain text value against the given hash,\r\n    /// this class will retrieve the salt value from the hash string and use it\r\n    /// when computing a new hash of the plain text. Appending a salt value to\r\n    /// the hash may not be the most efficient approach, so when using hashes in\r\n    /// a real-life application, you may choose to store them separately. You may\r\n    /// also opt to keep results as byte arrays instead of converting them into\r\n    /// base64-encoded strings.\r\n    /// </summary>\r\n    public class Hashing\r\n    {\r\n        public enum HashingAlgorithm\r\n        { eSHA1\r\n        , eSHA256\r\n        , eSHA384\r\n        , eSHA512\r\n        , eMD5\r\n        }\r\n\r\n        public static string GetHash(string a_Password)\r\n        { return ComputeHash(a_Password, HashingAlgorithm.eSHA512, null); }\r\n\r\n        /// <summary>\r\n        /// Generates a hash for the given plain text value and returns a\r\n        /// base64-encoded result. Before the hash is computed, a random salt\r\n        /// is generated and appended to the plain text. This salt is stored at\r\n        /// the end of the hash value, so it can be used later for hash\r\n        /// verification.\r\n        /// </summary>\r\n        /// <param name="plainText">\r\n        /// Plaintext value to be hashed. The function does not check whether\r\n        /// this parameter is null.\r\n        /// </param>\r\n        /// <param name="hashAlgorithm">\r\n        /// Name of the hash algorithm. Allowed values are: "MD5", "SHA1",\r\n        /// "SHA256", "SHA384", and "SHA512" (if any other value is specified\r\n        /// MD5 hashing algorithm will be used). This value is case-insensitive.\r\n        /// </param>\r\n        /// <param name="saltBytes">\r\n        /// Salt bytes. This parameter can be null, in which case a random salt\r\n        /// value will be generated.\r\n        /// </param>\r\n        /// <returns>\r\n        /// Hash value formatted as a base64-encoded string.\r\n        /// </returns>\r\n        public static string ComputeHash(string a_PlainText,\r\n                                         HashingAlgorithm a_HashAlgorithm,\r\n                                         byte[] a_SaltBytes)\r\n        {\r\n            // If salt is not specified, generate it on the fly.\r\n            if (a_SaltBytes == null)\r\n            {\r\n                // Define min and max salt sizes.\r\n                int l_MinSaltSize = 4;\r\n                int l_MaxSaltSize = 8;\r\n\r\n                // Generate a random number for the size of the salt.\r\n                Random l_Random = new Random();\r\n                int l_SaltSize = l_Random.Next(l_MinSaltSize, l_MaxSaltSize);\r\n\r\n                // Allocate a byte array, which will hold the salt.\r\n                a_SaltBytes = new byte[l_SaltSize];\r\n\r\n                // Initialize a random number generator.\r\n                RNGCryptoServiceProvider l_RNGCryptoServiceProvider = new RNGCryptoServiceProvider();\r\n\r\n                // Fill the salt with cryptographically strong byte values.\r\n                l_RNGCryptoServiceProvider.GetNonZeroBytes(a_SaltBytes);\r\n            }\r\n\r\n            // Convert plain text into a byte array.\r\n            byte[] l_PlainTextBytes = Encoding.UTF8.GetBytes(a_PlainText);\r\n\r\n            // Allocate array, which will hold plain text and salt.\r\n            byte[] l_PlainTextWithSaltBytes =\r\n                    new byte[l_PlainTextBytes.Length + a_SaltBytes.Length];\r\n\r\n            // Copy plain text bytes into resulting array.\r\n            for (int i = 0; i < l_PlainTextBytes.Length; i++)\r\n                l_PlainTextWithSaltBytes[i] = l_PlainTextBytes[i];\r\n\r\n            // Append salt bytes to the resulting array.\r\n            for (int i = 0; i < a_SaltBytes.Length; i++)\r\n                l_PlainTextWithSaltBytes[l_PlainTextBytes.Length + i] = a_SaltBytes[i];\r\n\r\n            // Because we support multiple hashing algorithms, we must define\r\n            // hash object as a common (abstract) base class. We will specify the\r\n            // actual hashing algorithm class later during object creation.\r\n            HashAlgorithm l_Hash;\r\n\r\n            // Initialize appropriate hashing algorithm class.\r\n            switch (a_HashAlgorithm)\r\n            {\r\n                case HashingAlgorithm.eSHA1:\r\n                    l_Hash = new SHA1Managed();\r\n                    break;\r\n\r\n                case HashingAlgorithm.eSHA256:\r\n                    l_Hash = new SHA256Managed();\r\n                    break;\r\n\r\n                case HashingAlgorithm.eSHA384:\r\n                    l_Hash = new SHA384Managed();\r\n                    break;\r\n\r\n                case HashingAlgorithm.eSHA512:\r\n                    l_Hash = new SHA512Managed();\r\n                    break;\r\n\r\n                default : // case HashingAlgorithm.eMD5:\r\n                    l_Hash = new MD5CryptoServiceProvider();\r\n                    break;\r\n            }\r\n\r\n            // Compute hash value of our plain text with appended salt.\r\n            byte[] l_HashBytes = l_Hash.ComputeHash(l_PlainTextWithSaltBytes);\r\n\r\n            // Create array which will hold hash and original salt bytes.\r\n            byte[] l_HashWithSaltBytes = new byte[l_HashBytes.Length +\r\n                                                a_SaltBytes.Length];\r\n\r\n            // Copy hash bytes into resulting array.\r\n            for (int i = 0; i < l_HashBytes.Length; i++)\r\n                l_HashWithSaltBytes[i] = l_HashBytes[i];\r\n\r\n            // Append salt bytes to the result.\r\n            for (int i = 0; i < a_SaltBytes.Length; i++)\r\n                l_HashWithSaltBytes[l_HashBytes.Length + i] = a_SaltBytes[i];\r\n\r\n            // Convert result into a base64-encoded string.\r\n            string l_HashValue = Convert.ToBase64String(l_HashWithSaltBytes);\r\n\r\n            // Return the result.\r\n            return l_HashValue;\r\n        }\r\n\r\n        /// <summary>\r\n        /// Compares a hash of the specified plain text value to a given hash\r\n        /// value. Plain text is hashed with the same salt value as the original\r\n        /// hash.\r\n        /// </summary>\r\n        /// <param name="plainText">\r\n        /// Plain text to be verified against the specified hash. The function\r\n        /// does not check whether this parameter is null.\r\n        /// </param>\r\n        /// <param name="hashAlgorithm">\r\n        /// Name of the hash algorithm. Allowed values are: "MD5", "SHA1", \r\n        /// "SHA256", "SHA384", and "SHA512" (if any other value is specified,\r\n        /// MD5 hashing algorithm will be used). This value is case-insensitive.\r\n        /// </param>\r\n        /// <param name="hashValue">\r\n        /// Base64-encoded hash value produced by ComputeHash function. This value\r\n        /// includes the original salt appended to it.\r\n        /// </param>\r\n        /// <returns>\r\n        /// If computed hash mathes the specified hash the function the return\r\n        /// value is true; otherwise, the function returns false.\r\n        /// </returns>\r\n        public static bool VerifyHash(string plainText,\r\n                                      HashingAlgorithm hashAlgorithm,\r\n                                      string hashValue)\r\n        {\r\n            // Convert base64-encoded hash value into a byte array.\r\n            byte[] hashWithSaltBytes = Convert.FromBase64String(hashValue);\r\n\r\n            // We must know size of hash (without salt).\r\n            int hashSizeInBits, hashSizeInBytes;\r\n\r\n            // Size of hash is based on the specified algorithm.\r\n            switch (hashAlgorithm)\r\n            {\r\n                case HashingAlgorithm.eSHA1:\r\n                    hashSizeInBits = 160;\r\n                    break;\r\n\r\n                case HashingAlgorithm.eSHA256:\r\n                    hashSizeInBits = 256;\r\n                    break;\r\n\r\n                case HashingAlgorithm.eSHA384:\r\n                    hashSizeInBits = 384;\r\n                    break;\r\n\r\n                case HashingAlgorithm.eSHA512:\r\n                    hashSizeInBits = 512;\r\n                    break;\r\n\r\n                default: // case HashingAlgorithm.eMD5:\r\n                    hashSizeInBits = 128;\r\n                    break;\r\n            }\r\n\r\n            // Convert size of hash from bits to bytes.\r\n            hashSizeInBytes = hashSizeInBits / 8;\r\n\r\n            // Make sure that the specified hash value is long enough.\r\n            if (hashWithSaltBytes.Length < hashSizeInBytes)\r\n                return false;\r\n\r\n            // Allocate array to hold original salt bytes retrieved from hash.\r\n            byte[] saltBytes = new byte[hashWithSaltBytes.Length -\r\n                                        hashSizeInBytes];\r\n\r\n            // Copy salt from the end of the hash to the new array.\r\n            for (int i = 0; i < saltBytes.Length; i++)\r\n                saltBytes[i] = hashWithSaltBytes[hashSizeInBytes + i];\r\n\r\n            // Compute a new hash string.\r\n            string expectedHashString =\r\n                        ComputeHash(plainText, hashAlgorithm, saltBytes);\r\n\r\n            // If the computed hash matches the specified hash,\r\n            // the plain text value must be correct.\r\n            return (hashValue == expectedHashString);\r\n        }\r\n    }\r\n\r\n    ///// <summary>\r\n    ///// Illustrates the use of the SimpleHash class.\r\n    ///// </summary>\r\n    //public class SimpleHashTest\r\n    //{\r\n    //    /// <summary>\r\n    //    /// The main entry point for the application.\r\n    //    /// </summary>\r\n    //    [STAThread]\r\n    //    static void Main(string[] args)\r\n    //    {\r\n    //        string password = "myP@5sw0rd";  // original password\r\n    //        string wrongPassword = "password";    // wrong password\r\n\r\n    //        string passwordHashMD5 =\r\n    //               Hashing.ComputeHash(password, Hashing.HashingAlgorithm.eMD5, null);\r\n    //        string passwordHashSha1 =\r\n    //               Hashing.ComputeHash(password, Hashing.HashingAlgorithm.eSHA1, null);\r\n    //        string passwordHashSha256 =\r\n    //               Hashing.ComputeHash(password, Hashing.HashingAlgorithm.eSHA256, null);\r\n    //        string passwordHashSha384 =\r\n    //               Hashing.ComputeHash(password, Hashing.HashingAlgorithm.eSHA384, null);\r\n    //        string passwordHashSha512 =\r\n    //               Hashing.ComputeHash(password, Hashing.HashingAlgorithm.eSHA512, null);\r\n\r\n    //        Console.WriteLine("COMPUTING HASH VALUES\\r\\n");\r\n    //        Console.WriteLine("MD5   : {0}", passwordHashMD5);\r\n    //        Console.WriteLine("SHA1  : {0}", passwordHashSha1);\r\n    //        Console.WriteLine("SHA256: {0}", passwordHashSha256);\r\n    //        Console.WriteLine("SHA384: {0}", passwordHashSha384);\r\n    //        Console.WriteLine("SHA512: {0}", passwordHashSha512);\r\n    //        Console.WriteLine("");\r\n\r\n    //        Console.WriteLine("COMPARING PASSWORD HASHES\\r\\n");\r\n    //        Console.WriteLine("MD5    (good): {0}",\r\n    //                            Hashing.VerifyHash(\r\n    //                            password, Hashing.HashingAlgorithm.eMD5,\r