      l_sb.Append( (++l_iErrorNumber)\r\n                               + ") ");\r\n                    if( l_ValidationEventArgs.Exception != null)\r\n                        l_sb.Append( "("\r\n                                   + l_ValidationEventArgs.Exception.LineNumber\r\n                                   + ", "\r\n                                   + l_ValidationEventArgs.Exception.LinePosition\r\n                                   + "): ");\r\n                    l_sb.AppendLine( l_ValidationEventArgs.Message);\r\n                }\r\n                l_ReturnCode = l_sb.ToString();\r\n            }\r\n            return l_ReturnCode;\r\n        }\r\n\r\n        public List<ValidationEventArgs> ValidationEventArgsList\r\n        { get { return m_ValidationEventArgsList; } }\r\n\r\n        private void ValidateXml(XmlTextReader l_XmlTextReader, string a_SchemaFilename)\r\n        {\r\n            using( XmlValidatingReader l_XmlValidatingReader = new XmlValidatingReader(l_XmlTextReader))\r\n            {\r\n                l_XmlValidatingReader.ValidationType = ValidationType.Schema;\r\n\r\n                XmlSchemaCollection l_XmlSchemaCollection = new XmlSchemaCollection();\r\n                l_XmlSchemaCollection.Add(null, a_SchemaFilename);\r\n                l_XmlValidatingReader.Schemas.Add(l_XmlSchemaCollection);\r\n\r\n                l_XmlValidatingReader.ValidationEventHandler += new ValidationEventHandler(ValidationEventHandler);\r\n\r\n                while (l_XmlValidatingReader.Read())\r\n                { }\r\n            }\r\n        }\r\n\r\n        internal void ValidationEventHandler(object sender, ValidationEventArgs args)\r\n        {\r\n            m_ValidationEventArgsList.Add(args);\r\n        }\r\n    }\r\n}\r\n', 'XML Validation', '2', '2008-02-04 09:09:59.079833', 'DENGLISH', '2008-02-04 09:09:59.079833', 'DENGLISH', 'Y', NULL),
