  ('201', '2008-02-20', NULL, NULL, 'using System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Diagnostics;\r\n\r\nnamespace Utilities\r\n{\r\n    public static class HexString\r\n    {\r\n        #region Conversions\r\n        public static string GetHexString(byte[] l_bytes, int a_Length)\r\n        {\r\n            char[] l_chars = new char[a_Length * 2];\r\n\r\n            for (int l_idx = 0; l_idx < a_Length; ++l_idx)\r\n            {\r\n                byte l_highByte = (byte)((int)l_bytes[l_idx] >> 4);\r\n                byte l_lowByte = (byte)((int)l_bytes[l_idx] & 0xF);\r\n\r\n                Debug.Assert(l_highByte < 16);\r\n                Debug.Assert(l_lowByte < 16);\r\n\r\n                l_chars[l_idx * 2] = GetHexChar(l_highByte);\r\n                l_chars[l_idx * 2 + 1] = GetHexChar(l_lowByte);\r\n            }\r\n\r\n            return new string(l_chars);\r\n        }\r\n\r\n        public static byte[] GetBytes(string a_HexifiedString)\r\n        {\r\n            Debug.Assert((a_HexifiedString.Length % 2) == 0);\r\n            byte[] l_bytes = new byte[a_HexifiedString.Length / 2];\r\n            for (int l_idx = 0; l_idx < l_bytes.Length; ++l_idx)\r\n            {\r\n                l_bytes[l_idx] = GetByte(a_HexifiedString[l_idx * 2]\r\n                                         , a_HexifiedString[l_idx * 2 + 1]);\r\n                //char a_HexifiedString[ l_idx * 2]\r\n            }\r\n            return l_bytes;\r\n        }\r\n\r\n        private static char GetHexChar(byte a_HexByte)\r\n        {\r\n            if (a_HexByte > 9)\r\n                return (char)(''A'' + (a_HexByte - 10));\r\n            return (char)(''0'' + a_HexByte);\r\n        }\r\n\r\n        private static byte GetByte(char l_highOrder, char l_lowOrder)\r\n        {\r\n            byte l_HighByte;\r\n            if (l_highOrder >= ''A'')\r\n                l_HighByte = (byte)((l_highOrder - ''A'') + 10);\r\n            else\r\n                l_HighByte = (byte)(l_highOrder - ''0'');\r\n\r\n            byte l_LowByte;\r\n            if (l_lowOrder >= ''A'')\r\n                l_LowByte = (byte)((l_lowOrder - ''A'') + 10);\r\n            else\r\n                l_LowByte = (byte)(l_lowOrder - ''0'');\r\n\r\n            l_HighByte <<= 4;\r\n            return (byte)(l_HighByte + l_LowByte);\r\n        }\r\n        #endregion\r\n    }\r\n}\r\n', 'HexString', '2', '2008-02-20 14:34:10.043066', 'DENGLISH', '2008-02-20 14:34:10.043066', 'DENGLISH', 'Y', NULL),
