n))\r\n                {\r\n                    cstream.Write(br.ReadBytes((int)fsIn.Length), 0, (int)fsIn.Length);\r\n                    cstream.FlushFinalBlock();\r\n\r\n                    l_bb = new ByteBuffer(fsOut.GetBuffer(), (int)fsOut.Length);\r\n                }\r\n            }\r\n\r\n            return l_bb;\r\n        }\r\n\r\n        private static string DecryptBytes(ByteBuffer l_bb)\r\n        {\r\n            string l_OrigData;\r\n            using (MemoryStream fsIn2 = new MemoryStream(l_bb.Bytes, 0, l_bb.Size))\r\n            {\r\n                ICryptoTransform transform = (new RijndaelManaged()).CreateDecryptor(m_key, m_IV);\r\n                using (CryptoStream cstream = new CryptoStream(fsIn2, transform, CryptoStreamMode.Read))\r\n                using (StreamReader sr = new StreamReader(cstream))\r\n                {\r\n                    l_OrigData = sr.ReadToEnd();\r\n                    fsIn2.Close();\r\n                }\r\n            }\r\n\r\n            return l_OrigData;\r\n        }\r\n    }\r\n}\r\n', 'BasicEncryption', '2', '2008-02-20 14:34:31.672171', 'DENGLISH', '2008-02-20 14:34:31.672171', 'DENGLISH', 'Y', NULL),
