ationEventArgs.Exception.LineNumber\r\n                                   + ", "\r\n                                   + l_ValidationEventArgs.Exception.LinePosition\r\n                                   + "): ");\r\n                    l_sb.AppendLine(l_ValidationEventArgs.Message);\r\n                }\r\n                return l_sb.ToString();\r\n            }\r\n            return "0";\r\n        }\r\n\r\n        \r\n        public List<ValidationEventArgs> ValidationEventArgsList\r\n        { get { return m_ValidationEventArgsList; } }\r\n\r\n        private void Handler(object sender, ValidationEventArgs e)\r\n        { m_ValidationEventArgsList.Add(e); }\r\n    }\r\n}\r\n', 'SchemaSet', '2', '2008-04-29 13:40:59.988631', 'DENGLISH', '2008-04-29 13:40:59.988631', 'DENGLISH', 'Y', NULL),
