           foreach (string l_RelativeUrl in l_relativeURLsFound)\r\n                Console.Out.WriteLine("Url[" + (++l_iCount) + "]: " + l_RelativeUrl);\r\n        }\r\n    }\r\n}\r\n\r\nusing System;\r\nusing System.Collections.Generic;\r\nusing System.Text;\r\nusing System.Text.RegularExpressions;\r\nusing System.Diagnostics;\r\n\r\nnamespace ParseCL\r\n{\r\n    public class GetDataPageList\r\n    {\r\n        private GetWebsiteData m_GetWebsiteData;\r\n        private string m_DataPageUrlRegularExpression;\r\n        private string m_NextPageUrlRegularExpression;\r\n        private string m_DirectoryRoot;\r\n        private string m_Directory;\r\n        private Regex m_ListingRegex;\r\n        private Regex m_NextPageRegex;\r\n\r\n        public GetDataPageList(GetWebsiteData a_GetWebsiteData\r\n                              , string a_DataPageUrlRegularExpression\r\n                              , string a_NextPageUrlRegularExpression\r\n                              , string a_DirectoryRoot\r\n                              , string a_Directory\r\n                              )\r\n        {\r\n            m_GetWebsiteData = a_GetWebsiteData;\r\n            m_DataPageUrlRegularExpression = a_DataPageUrlRegularExpression;\r\n            m_NextPageUrlRegularExpression = a_NextPageUrlRegularExpression;\r\n            m_DirectoryRoot = a_DirectoryRoot;\r\n            m_Directory = a_Directory;\r\n            m_ListingRegex = new Regex(m_DataPageUrlRegularExpression);\r\n            m_NextPageRegex = new Regex(m_NextPageUrlRegularExpression);\r\n        }\r\n\r\n        public List<string> GetList()\r\n        {\r\n            List<string> l_list = new List<string>();\r\n            while(   (m_Directory != string.Empty)\r\n                   && (l_list.Count < 1000))\r\n            {\r\n                string l_Content = m_GetWebsiteData.GetPageContent(m_DirectoryRoot + m_Directory);\r\n\r\n                MatchCollection l_MatchCollection = m_ListingRegex.Matches