a'')\r\n                            && (l_ch <= ''z''))\r\n                       || ((l_ch >= ''A'')\r\n                            && (l_ch <= ''Z''))\r\n                       || (l_ch == ''_'')\r\n                       || (l_ch == '':''))\r\n                {\r\n                    ++m_iPosition;\r\n                    l_sb.Append((char)m_TextReader.Read());\r\n                    l_ch = (char)m_TextReader.Peek();\r\n                }\r\n                return l_sb.ToString();\r\n            }\r\n\r\n            public string WhiteSpace()\r\n            {\r\n                StringBuilder l_sb = new StringBuilder();\r\n                char l_ch = (char)m_TextReader.Peek();\r\n                while ((l_ch == '' '')\r\n                       || (l_ch == ''\\t'')\r\n                       || (l_ch == ''\\r'')\r\n                       || (l_ch == ''\\n''))\r\n                {\r\n                    ++m_iPosition;\r\n                    l_sb.Append((char)m_TextReader.Read());\r\n                    l_ch = (char)m_TextReader.Peek();\r\n                }\r\n                return l_sb.ToString();\r\n            }\r\n\r\n            public string ReadUntil(char a_ch)\r\n            {\r\n                StringBuilder l_sb = new StringBuilder();\r\n                char l_ch = (char)m_TextReader.Peek();\r\n                while (l_ch != a_ch)\r\n                {\r\n                    ++m_iPosition;\r\n                    l_sb.Append((char)m_TextReader.Read());\r\n                    l_ch = (char)m_TextReader.Peek();\r\n                }\r\n                return l_sb.ToString();\r\n            }\r\n\r\n            public void ValidateCharacter(char a_ch)\r\n            {\r\n                if (((char)m_TextReader.Peek()) != a_ch)\r\n                    throw new Exception("Expected Equals Sign");\r\n                m_TextReader.Read();\r\n                ++m_iPosition;\r\n            }\r\n        }\r\n\r\n        public XmlRichTextBoxSyntaxHighlightingLW(RichTextBox a_RichTextBox)\r\n        {\r\n            m_RichTextBox = a_RichTextBox;\r\n            m_RegularFont = new Font(m_RichTextBox.SelectionFont.FontFamily.Name\r\n                                    , m_RichTextBox.SelectionFont.Size\r\n                                    , FontStyle.Regular);\r\n            m_BoldFont = new Font(m_RichTextBox.SelectionFont.FontFamily.Name\r\n                                 , m_RichTextBox.SelectionFont.Size\r\n                                 , FontStyle.Bold);\r\n            \r\n            m_ColorWhenStarting = m_RichTextBox.SelectionColor;\r\n\r\n            int l_LastPosition = 0;\r\n            bool l_bHadAttributes = false;\r\n\r\n            XmlNodeType l_LastXmlNodeType = XmlNodeType.None;\r\n\r\n            //SLog.Reset();\r\n            //File.WriteAllText(@"c:\\Temp\\rtb.xml", m_RichTextBox.Text);\r\n            using (MemoryStream l_ms = new MemoryStream(Encoding.ASCII.GetBytes( m_RichTextBox.Text)))\r\n            using (XmlTextReader l_XmlReader = new XmlTextReader(l_ms))\r\n            {\r\n                while(l_XmlReader.Read())\r\n                {\r\n                    int l_CurrentPosition = (int)m_RichTextBox.GetFirstCharIndexFromLine((int)l_XmlReader.LineNumber - 1) + (int)l_XmlReader.LinePosition - 1;\r\n                    //SLog.WriteLine("Line: " + l_XmlReader.LineNumber\r\n                    //              + " Col: " + l_XmlReader.LinePosition\r\n                    //              + " CurrPos: " + l_CurrentPosition\r\n                    //              + " CharsFromLine: " + m_RichTextBox.GetFirstCharIndexFromLine((int)l_XmlReader.LineNumber - 1));\r\n\r\n                    if (l_LastXmlNodeType != XmlNodeType.None)\r\n                    {\r\n                        //m_RichTextBox.Select( l_LastPosition, l_CurrentPosition);\r\n                        //SLog.WriteLine("Selected Text: " + m_RichTextBox.SelectedText);\r\n                        ColorNode(l_LastPosition, l_bHadAttributes, l_LastXmlNodeType, l_XmlReader, l_CurrentPosition);\r\n                    }\r\n\r\n                    l_LastPosition = l_CurrentPosition;\r\n                    l_LastXmlNodeType = l_XmlReader.NodeType;\r\n                    l_bHadAttributes = l_XmlReader.HasAttributes;\r\n                }\r\n            }\r\n            //m_RichTextBox.Select(0, 0);\r\n            //m_RichTextBox.SelectionColor = m_ColorWhenStarting;\r\n        }\r\n\r\n        private void ColorNode(int l_LastPosition, bool l_bHadAttributes, XmlNodeType l_LastXmlNodeType, XmlTextReader l_XmlReader, int l_CurrentPosition)\r\n        {\r\n            switch (l_LastXmlNodeType)\r\n            {\r\n                case XmlNodeType.Attribute:\r\n                    //ColorAttribute(l_LastPosition, l_CurrentPosition);\r\n                    throw new Exception("This has never been seen in parsing: " + l_XmlReader.NodeType);\r\n                    //break;\r\n                case XmlNodeType.Element:\r\n                    m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    m_RichTextBox.SelectionColor = m_ElementNameFontColor;\r\n                    ColorAttribute(l_LastPosition, l_bHadAttributes);\r\n                    break;\r\n                case XmlNodeType.EndElement:\r\n                    m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    m_RichTextBox.SelectionColor = m_ElementNameFontColor;\r\n                    //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n                    break;\r\n                case XmlNodeType.Text:\r\n                    m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    m_RichTextBox.SelectionColor = this.m_CharactersColor;\r\n                    break;\r\n                case XmlNodeType.Whitespace:\r\n                    break;\r\n                case XmlNodeType.XmlDeclaration:\r\n                    //m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    //m_RichTextBox.SelectionColor = m_ElementNameFontColor;\r\n                    //ColorAttribute(l_LastPosition, l_bHadAttributes);\r\n                    break;\r\n                case XmlNodeType.Comment:\r\n                    //m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    //m_RichTextBox.SelectionColor = this.m_CommentColor;\r\n                    break;\r\n                default:\r\n                    throw new Exception("This has never been seen in parsing: " + l_XmlReader.NodeType);\r\n            }\r\n        }\r\n\r\n        private void ColorAttribute(int l_LastPosition, bool l_bHadAttributes)\r\n        {\r\n            if (l_bHadAttributes)\r\n            {\r\n                string l_text = m_RichTextBox.SelectedText;\r\n                using (Tokenizer l_Tokenizer = new Tokenizer(l_text))\r\n                {\r\n                    string l_ElementName = l_Tokenizer.Identifier();\r\n                    string l_sw = l_Tokenizer.WhiteSpace();\r\n\r\n                    string l_AttributeName = l_Tokenizer.Identifier();\r\n                    while (l_AttributeName.Length > 0)\r\n                    {\r\n                        m_RichTextBox.Select(l_LastPosition + l_Tokenizer.Position - l_AttributeName.Length, l_AttributeName.Length);\r\n                        m_RichTextBox.SelectionColor = this.m_AttributeNameColor;\r\n                        //m_RichTextBox.SelectionBackColor = Color.White;\r\n\r\n                        l_Tokenizer.WhiteSpace();\r\n\r\n                        l_Tokenizer.ValidateCharacter(''='');\r\n                        m_RichTextBox.Select(l_LastPosition + l_Tokenizer.Position - 1, 1);\r\n                        m_RichTextBox.SelectionColor = this.m_EqualsColor;\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightBlue;\r\n\r\n                        l_Tokenizer.WhiteSpace();\r\n\r\n                        l_Tokenizer.ValidateCharacter(''"'');\r\n                        m_RichTextBox.Select(l_LastPosition + l_Tokenizer.Position - 1, 1);\r\n                        m_RichTextBox.SelectionColor = this.m_QuoteColor;\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n\r\n                        string l_AttributeValue = l_Tokenizer.ReadUntil(''"'');\r\n                        m_RichTextBox.Select(l_LastPosition + l_Tokenizer.Position - l_AttributeValue.Length, l_AttributeValue.Length);\r\n                        m_RichTextBox.SelectionColor = this.m_AttributeValueColor;\r\n                        //m_RichTextBox.SelectionBackColor = Color.White;\r\n\r\n                        l_Tokenizer.ValidateCharacter(''"'');\r\n                        m_RichTextBox.Select(l_LastPosition + l_Tokenizer.Position - 1, 1);\r\n                        m_RichTextBox.SelectionColor = this.m_QuoteColor;\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n\r\n                        string l_ws = l_Tokenizer.WhiteSpace();\r\n\r\n                        l_AttributeName = l_Tokenizer.Identifier();\r\n                    }\r\n                }\r\n            }\r\n        }\r\n    }\r\n}\r\n', 'XmlRichTextBoxSyntaxHighlightingLW', '2', '2008-08-01 17:11:07.134194', 'DENGLISH', '2008-08-01 17:11:07.134194', 'DENGLISH', 'Y', NULL),
