r\n                                  + " Col: " + l_XmlReader.LinePosition\r\n                                  + " CurrPos: " + l_CurrentPosition);\r\n\r\n                    if (l_LastXmlNodeType != XmlNodeType.None)\r\n                    {\r\n                        //m_RichTextBox.Select( l_LastPosition, l_CurrentPosition);\r\n                        //SLog.WriteLine("Selected Text: " + m_RichTextBox.SelectedText);\r\n                        ColorNode(l_LastPosition, l_bHadAttributes, l_LastXmlNodeType, l_XmlReader, l_CurrentPosition);\r\n                    }\r\n\r\n                    l_LastPosition = l_CurrentPosition;\r\n                    l_LastXmlNodeType = l_XmlReader.NodeType;\r\n                    l_bHadAttributes = l_XmlReader.HasAttributes;\r\n                }\r\n                l_CurrentPosition = (int)m_RichTextBox.GetFirstCharIndexFromLine((int)l_XmlReader.LineNumber - 1) + (int)l_XmlReader.LinePosition - 1;\r\n                ColorNode(l_LastPosition, l_bHadAttributes, l_LastXmlNodeType, l_XmlReader, l_CurrentPosition);\r\n            }\r\n            //m_RichTextBox.Select(0, 0);\r\n            //m_RichTextBox.SelectionColor = m_ColorWhenStarting;\r\n        }\r\n\r\n        private void ColorNode(int l_LastPosition, bool l_bHadAttributes, XmlNodeType l_LastXmlNodeType, XmlTextReader l_XmlReader, int l_CurrentPosition)\r\n        {\r\n            switch (l_LastXmlNodeType)\r\n            {\r\n                case XmlNodeType.Attribute:\r\n                    //ColorAttribute(l_LastPosition, l_CurrentPosition);\r\n                    throw new Exception("This has never been seen in parsing: " + l_XmlReader.NodeType);\r\n                    //break;\r\n                case XmlNodeType.Element:\r\n                    m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    if( m_RichTextBox.SelectedText.EndsWith("/"))\r\n                        m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 2);\r\n                    else if (m_RichTextBox.SelectedText.EndsWith("><"))\r\n                        m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 3);\r\n\r\n                    SLog.WriteLine("l_LastXmlNodeType = XmlNodeType.Element: " + m_RichTextBox.SelectedText);\r\n                    if (!ColorAttribute(l_LastPosition, l_bHadAttributes))\r\n                        m_RichTextBox.SelectionColor = m_ElementNameFontColor;\r\n                    break;\r\n                case XmlNodeType.EndElement:\r\n                    m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    SLog.WriteLine("l_LastXmlNodeType = XmlNodeType.EndElement: " + m_RichTextBox.SelectedText);\r\n                    m_RichTextBox.SelectionColor = m_ElementNameFontColor;\r\n                    //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n                    break;\r\n                case XmlNodeType.Text:\r\n                    m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    SLog.WriteLine("l_LastXmlNodeType = XmlNodeType.Element: " + m_RichTextBox.SelectedText);\r\n                    m_RichTextBox.SelectionColor = this.m_CharactersColor;\r\n                    break;\r\n                case XmlNodeType.Whitespace:\r\n                    break;\r\n                case XmlNodeType.XmlDeclaration:\r\n                    m_RichTextBox.Select(l_LastPosition, l_CurrentPosition - l_LastPosition - 1);\r\n                    SLog.WriteLine( "l_LastXmlNodeType = XmlNodeType.XmlDeclaration: " + m_RichTextBox.SelectedText);\r\n                    m_RichTextBox.SelectionColor = m_ElementNameFontColor;\r\n                    ColorAttribute(l_LastPosition, l_bHadAttributes);\r\n                    break;\r\n                case XmlNodeType.Comment:\r\n                    m_RichTextBox.Select(l_LastPosition - 4, l_CurrentPosition - l_LastPosition + 3);\r\n                    SLog.WriteLine("l_LastXmlNodeType = XmlNodeType.Comment: " + m_RichTextBox.SelectedText);\r\n                    m_RichTextBox.SelectionColor = this.m_CommentColor;\r\n                    break;\r\n                default:\r\n                    throw new Exception("This has never been seen in parsing: " + l_XmlReader.NodeType);\r\n            }\r\n        }\r\n\r\n        private void ColorSection( int a_iStartPosition, int a_iLength, Color a_Color)\r\n        {\r\n            m_RichTextBox.Select(a_iStartPosition, a_iLength);\r\n            m_RichTextBox.SelectionColor = a_Color;\r\n            SLog.WriteLine("  -> Color Section: " + m_RichTextBox.SelectedText);\r\n        }\r\n\r\n        private bool ColorAttribute(int l_LastPosition, bool l_bHadAttributes)\r\n        {\r\n            if (l_bHadAttributes)\r\n            {\r\n                string l_text = m_RichTextBox.SelectedText;\r\n                using (Tokenizer l_Tokenizer = new Tokenizer(l_text))\r\n                {\r\n                    string l_ElementName = l_Tokenizer.Identifier();\r\n                    ColorSection(l_LastPosition + l_Tokenizer.Position - l_ElementName.Length\r\n                                , l_ElementName.Length\r\n                                , this.m_ElementNameFontColor);\r\n                    \r\n                    string l_sw = l_Tokenizer.WhiteSpace();\r\n\r\n                    string l_AttributeName = l_Tokenizer.Identifier();\r\n                    while (l_AttributeName.Length > 0)\r\n                    {\r\n                        ColorSection(l_LastPosition + l_Tokenizer.Position - l_AttributeName.Length\r\n                                    , l_AttributeName.Length\r\n                                    , this.m_AttributeNameColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.White;\r\n\r\n                        l_Tokenizer.WhiteSpace();\r\n\r\n                        l_Tokenizer.ValidateCharacter(''='');\r\n                        ColorSection( l_LastPosition + l_Tokenizer.Position - 1, 1, this.m_EqualsColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightBlue;\r\n\r\n                        l_Tokenizer.WhiteSpace();\r\n\r\n                        l_Tokenizer.ValidateCharacter(''"'');\r\n                        ColorSection( l_LastPosition + l_Tokenizer.Position - 1, 1, this.m_QuoteColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n\r\n                        string l_AttributeValue = l_Tokenizer.ReadUntil(''"'');\r\n                        ColorSection(l_LastPosition + l_Tokenizer.Position - l_AttributeValue.Length, l_AttributeValue.Length, m_AttributeValueColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.White;\r\n\r\n                        l_Tokenizer.ValidateCharacter(''"'');\r\n                        ColorSection(l_LastPosition + l_Tokenizer.Position - 1, 1, this.m_QuoteColor);\r\n                        //m_RichTextBox.SelectionBackColor = Color.LightCoral;\r\n\r\n                        string l_ws = l_Tokenizer.WhiteSpace();\r\n\r\n                        l_AttributeName = l_Tokenizer.Identifier();\r\n                    }\r\n                }\r\n                return true;\r\n            }\r\n            return false;\r\n        }\r\n    }\r\n}\r\n//using System;\r\n//using System.Collections.Generic;\r\n//using System.Text;\r\n//using System.Windows.Forms;\r\n//using System.Xml;\r\n//using Utilities;\r\n//using System.IO;\r\n//using System.Drawing;\r\n\r\n//namespace Utilities\r\n//{\r\n//    public class XmlRichTextBoxSyntaxHighlighting : SaxParser\r\n//    {\r\n//        private RichTextBox m_RichTextBox;\r\n\r\n//        private Font m_RegularFont;\r\n//        private Font m_BoldFont;\r\n\r\n//        private Color m_BracketFontColor        = Color.DarkRed;\r\n//        private Color m_ElementNameFontColor    = Color.Green;\r\n//        private Co